INSERT INTO `movie` (`id`, `title`, `description`, `durationMinutes`, `image`, `trailer`, `releasedate`, `tmdbid`) VALUES
(1, 'Trolls World Tour', 'Die Trolls-Welt gerät aus den Fugen, als unsere beliebten Figuren entdecken, dass sie nur einer von sechs Trolls-Stämmen sind, die alle von unterschiedlichen Musikrichtungen geprägt sind: Funk, Country, Techno, Klassik, Pop und Rock. Damit ist zumindest eines klar: Ihre Welt wird nicht nur größer, sondern auch sehr viel bunter und lauter! Die Königin des Hard Rock, Queen Barb hat einen finsteren Plan gefasst: Sie will alle anderen Arten von Musik vernichten, damit einzig und allein der Rock die Herrschaft übernehmen kann. Das müssen Poppy und Branch verhindern – Ihre Mission: Alle Trolls vereinen, Barb besiegen, die alle anderen im wahrsten Sinne des Wortes an die Wand spielen will und die Welt retten!', 94, '6kJkuYpTvKP8AXw2EAG5WJFDxpf.jpg', NULL, '2020-03-12', 446893),
(2, 'Gretel & Hänsel: Ein Märchen neu erzählt', 'Vor langer Zeit, in einem verfluchten Land: Die verzweifelte Suche nach Nahrung und Arbeit zwingen die junge Gretel und ihren kleinen Bruder Hänsel dazu, das elterliche Haus zu verlassen. Völlig orientierungslos irren sie umher und verlaufen sich in einem tiefen, dunklen Wald. Als sie auf eine Hütte stoßen, in der eine alte, freundlich wirkende Frau lebt, glauben Gretel und Hänsel, Zuflucht gefunden zu haben. Aber die von der Alten in Zeiten der Hungersnot aufgetischten Festmähler, das unheimliche Gemurmel fremder Kinderstimmen und mysteriöse Erscheinungen im Haus, lassen Gretel erahnen, dass sich hinter ihrem scheinbaren Glück etwas Böses verbirgt. Kann sie ihren jüngeren Bruder beschützen oder wird sie den Versuchungen erliegen, die in ihr aufsteigen? Langsam bahnt sich das Grauen seinen Weg...', 87, 'yYFhBLspX5kqxjVtLqLnFmBJvkm.jpg', NULL, '2020-01-30', 542224),
(3, 'After Truth', 'Nachdem Hardin sie sehr verletzt hat, beschloss Tessa, die Beziehung mit ihm zu beenden. Lange Zeit wurde ihr die Wahrheit über ihn vorenthalten, nun, da sie davon weiß, fühlt sie sich hintergangen und gedemütigt. Nach den Ereignissen will sie einfach nur noch zurück in ihr altes Leben, dem Leben, was sie vor Hardin geführt hat. Als sie ihr Traum-Praktikum bei der Vance Publishing Company bekommt, scheint der erste Schritt geglückt. Dort erregt sie die Aufmerksamkeit ihres neuen Kollegen Trevor, der genau die Art Mann ist, mit dem Tessa eigentlich zusammen sein sollte...', 105, '51DHmkP62AS6037gc0GKs1uzlBy.jpg', NULL, '2020-09-02', 613504),
(4, 'Borat Anschluss-Moviefilm', '14 Jahre nach seinem Film über seine Reise durch die USA riskiert Borat Leib und Leben, als er mit seiner Tochter in die Staaten zurückkehrt und noch mehr über die amerikanische Kultur, die COVID-19 Pandemie und die Wahlen enthüllt.', 96, '6agKYU5IQFpuDyUYPu39w7UCRrJ.jpg', NULL, '2020-10-23', 740985),
(5, 'Dumbo', 'In der Manege macht dem Zirkusstar Holt Farrier keiner so schnell etwas vor – doch dann kam der Krieg und plötzlich war nichts mehr, wie es einmal war. Nach seiner Heimkehr findet er dennoch zurück zu seinen Wurzeln, als ihn der Zirkusdirektor Max Medici einstellt, um sich um einen kleinen Elefanten namens Dumbo zu kümmern, der aufgrund seiner großen Ohren zur Zielscheibe fieser Witzeleien wird. Als Holts Kinder Milly und Joe jedoch herausfinden, dass ihr dickhäutiger Freund fliegen kann, wendet sich das Blatt: Der Unternehmer V.A. Vandevere wird auf den außergewöhnlichen Vierbeiner aufmerksam und holt ihn prompt an Bord seines erfolgreichen Vergnügungsparks Dreamland, wo Dumbo an der Seite von Akrobatin Colette Marchant schnell zur großen Nummer wird. Doch er muss sich in Acht nehmen, im Dreamland ist nämlich nicht alles so perfekt, wie es auf den ersten Blick scheint...', 112, 'jnbAgkGZYGJ7wKZWMBPxjCfGH6r.jpg', NULL, '2019-03-27', 329996),
(6, 'Cats', 'Verfilmung des berühmten Musicals \"Cats\" von Sir Andrew Lloyd Webber, das 1981 uraufgeführt wurde. Im Musical werden die Geschichten verschiedener Mitglieder der Katzenschar „Jellicle Cats“ erzählt, die jedes Jahr zum großen „Jellicle Ball“ auf einer Londoner Müllkippe zusammenkommen.', 110, 'jZpEAqoaUBiK2SSVEdyF3LTDegj.jpg', NULL, '2019-12-19', 536869),
(7, 'Everest - Ein Yeti will hoch hinaus', 'Ein kleiner Yeti ist einem Versuchslabor in Shanghai entkommen und sucht Zuflucht auf den Dächern der Millionenstadt. Dort begegnet er ausgerechnet dem neugierigen Teenager-Mädchen Yi und ihren Freunden Jin und Peng. Schnell wird klar, dass das Trio den kleinen Yeti, den sie kurzerhand auf den Namen \"Everest\" taufen, nur vor dem finsteren Laborleiter Burnish und der Zoologin Dr. Zara retten können, wenn sie ihn zurück in seine Heimat bringen. Gemeinsam begeben sich die Freunde auf eine faszinierende Reise durch sagenhafte Landschaften, wunderliche Ereignisse und magische Momente, um Everest am höchsten Punkt der Erde wieder mit seiner Familie zu vereinen.', 98, 'cJYVF8AHfmYG2Dk9JyDQi6Dw8hf.jpg', NULL, '2019-09-19', 431580),
(8, 'Alita: Battle Angel', 'Auf der Erde sind im 26. Jahrhundert 300 Jahre nach dem großen Krieg die gesellschaftlichen Systeme zerfallen. Bei seiner Suche nach Cyborg-Technologie rettet der mysteriöse Wissenschaftler Dr. Ido aus einem Schrotthaufen eine weibliche Cyborg. Er flickt die künstliche Frau, deren Körper bis auf ihr menschliches Gehirn aus Maschinenteilen besteht, wieder zusammen, und wird zu einer Art Ersatzvater für sie. Doch Alita ist ein gefährliches Wesen. Sie kann sich nicht erinnern, wer sie ist oder woher sie kommt. Dr. Ido jedoch glaubt, dass sie diejenige ist, die den Kreislauf von Tod und Zerstörung, der von Tiphares zurückgelassen wurde, durchbrechen kann. Um ihrer wahren Bestimmung zu folgen, muss Alita kämpfen und töten. Als ein Geschenk des Himmels ist sie doch auch ein Engel des Todes.', 122, 'vrQ0H7UsrB585wE6prROtZ229j4.jpg', NULL, '2019-01-31', 399579),
(9, 'Toy Story 4 – Alles hört auf kein Kommando', 'Die Cowboy-Puppe Woody und sein Freund Buzz Lightyear haben sich mit den anderen Spielsachen gut im Kinderzimmer ihrer neuen Besitzerin, Bonnie, eingerichtet. Als das Mädchen aus einem Göffel (Gabel + Löffel) ein neues Spielzeug namens Forky bastelt und es ins Herz schließt, nehmen sie den ungewöhnlichen Zuwachs mit offenen Armen in ihre Mitte auf. Doch Forky sieht sich selbst eher als Abfall an und flüchtet, woraufhin Woody sich auf die Suche nach ihm macht, um ihn zurückzubringen.  Auf dem Ausflug im Wohnwagen mit Bonnies Familie nimmt Woody außerdem einen unerwarteten Umweg und trifft so in einem Antiquitätenladen seine verlorene Freundin, die Schäferin Bo Peep, wieder. Und dann taucht auch noch ein Freizeitpark am Horizont auf, der das Leben der Spielzeuge zusätzlich ins Chaos stürzt.', 100, 's1Laea6lrtQVs4HLC1Mtkjl9UAp.jpg', NULL, '2019-06-19', 301528),
(10, 'Bohemian Rhapsody', '„Bohemian Rhapsody“ erzählt die Geschichte, wie Freddie Mercury, Brian May, Roger Taylor und John Deacon die Band Queen gründeten – eine der legendärsten Rockgruppen aller Zeiten. Durch so grundverschiedene Songs wie „Killer Queen“, „Bohemian Rhapsody“, „We Are The Champions“ und „We Will Rock You“ sowie unzähligen weiteren Songs gelang der Band ein beispielloser Erfolg, der Freddie zu einem der beliebtesten Entertainer weltweit machte. Doch hinter der Fassade von Erfolg kämpft Freddie mit seiner inneren Zerrissenheit. Der aus Sansibar stammende Parse sucht unablässig nach seinem Platz in der Welt, während er gleichzeitig versucht, sich in einer Gesellschaft, die in Stereotypen und Erwartungen gefangen ist, mit einer Sexualität zu arrangieren, die er selbst kaum definieren kann. Freddie wagt es, sich zu widersetzen, aber zahlt auch den Preis dafür …', 135, 'cVh32auxySnfekNYLqozymGroBi.jpg', NULL, '2018-10-24', 424694),
(11, 'Die kleine Meerjungfrau', 'Realverfilmung des Disney-Zeichentrickklassikers: Meerjungfrau Arielle ist die Lieblingstochter von König Triton, aber auch der eigensinnigste Spross des Herrschers. Immer wieder bricht das junge Mädchen mit der schönen Stimme die Regeln und nähert sich der Welt der Menschen, was in Tritons Reich unter dem Meer streng verboten ist. Arielle ist fasziniert von den Alltagsgegenständen der Menschen, ihren Sitten und Gebräuchen, und als sie sich dann auch noch in den Menschenprinzen Eric verliebt, lässt sie alle Vorsicht fahren. Und auch Eric bekommt die schöne Stimme des Mädchens nicht aus dem Kopf, die er über das Meer hallen hörte. Arielle bittet die Meereshexe Ursula, ihr Menschenbeine zu geben, um mich Eric zusammen sein zu können. Allerdings muss sie mit ihrer Stimme dafür bezahlen und als sie an Land geht, erkennt Eric die nun stumme Arielle nicht wieder, da er sich nur in ihre Stimme verliebt hatte…', 79, 'zHyfyixGqsoFyQdusnowbwFsTDE.jpg', NULL, '2018-08-02', 385448),
(12, 'Meg', 'Nachdem ein Tiefsee-U-Boot von einem ausgestorben geglaubten Riesenhai angegriffen wird, sinkt das Fahrzeug in den tiefsten Graben des Pazifik und liegt dort manövrierunfähig am Meeresgrund. Der Crew an Bord läuft allmählich die Zeit davon und daher engagiert der Meeresforscher Dr. Minway Zhang den erfahrenen Taucher Jonas Taylor. Taylor ist zwar Experte für Bergungen in der Tiefsee, allerdings ist er vor Jahren schon einmal mit dem urzeitlichen Riesenhai, einem mehr als 20 Meter langen Megalodon, aneinandergeraten. Doch gemeinsam mit Dr. Zhangs Tochter Suyin muss er nun seine Ängste überwinden und schwere Geschütze auffahren, um den eingeschlossenen Menschen zur Hilfe eilen zu können und die Weltmeere von der Schreckensherrschaft des Urzeitmonsters zu befreien…', 113, 'tHRKw0fCQLzQfnNOfZdOuWfqViE.jpg', NULL, '2018-08-09', 345940),
(13, 'The Nun', 'Im Mittelpunkt steht der fiese Nonnen-Dämon Valak. In den 50ern wird Father Burke auf dessen Spur angesetzt, als ihm seine Vorgesetzten im Vatikan den Auftrag erteilen, den mysteriösen Tod einer Ordensschwester zu untersuchen. Sie nahm sich in einem abgelegenen rumänischen Kloster das Leben. Burke, durch seine Vergangenheit tief traumatisiert, wird von der Novizin Irene begleitet, die bald ihr Ordensgelübde ablegen soll. Zusammen erforschen sie das schreckliche Geheimnis des Klosters...', 96, 'cDgQfc5gqae2XeTs9hkr7II3u4W.jpg', NULL, '2018-09-05', 439079),
(14, 'Overboard', 'Der verwöhnte und wohlhabende Yachtbesitzer und mexikanische Macho Leonardo behandelt seine Angestellten wie den letzten Dreck. Als er eines Tages von Bord seines Schiffes fällt und sein Gedächtnis verliert, nutzt seine zuvor gefeuerte putzende Angestellte Kate, die alleinerziehende Mutter dreier Kinder, das aus und gönnt sich den unerwarteten Luxus.', 112, 'pUwLzc9u6Tt1aPRJLK0kbY92qhH.jpg', NULL, '2018-05-03', 454619),
(15, 'Wonder Woman', 'Diana stammt von Themyscira, der Insel der Amazonen, wo Frauen regieren und es keine Männer gibt. Doch auch auf dem paradiesisch wirkenden Eiland geht es um Macht und Kampf. Schon als Kind lernt Diana von ihrer Tante Antiope das Kämpfen. Als der amerikanische Pilot Steve Trevor auf der Insel strandet und von einem grauenvollen Krieg berichtet, der in der Welt der Menschen tobt, vermutet Diana dahinter das Wirken des vor langer Zeit verbannten Kriegsgottes Ares. So folgt sie Steve in unsere Welt und lässt ihr Zuhause mit ihrer Mutter, Königin Hippolyta, hinter sich, um Ares dort zu suchen, wo das Schlachtgetümmel am dichtesten ist. Doch in den Wirren des Ersten Weltkriegs bekommt sie es zunächst mit dem deutschen Heerführer General Ludendorff und dessen getreuer Wissenschaftlerin Dr. Maru zu tun, die den Krieg mit allen Mitteln für sich entscheiden wollen...', 140, 'uHdu2Lp0xnvMaBeYqY700bB6997.jpg', NULL, '2017-05-30', 297762),
(16, 'Coco - Lebendiger als das Leben!', 'Miguel ist zwölf Jahre alt und ein großer Fan von Musik – aber leider hasst seine Schusterfamilie alles, was mit Tönen und Instrumenten zu tun hat. Miguels Ururgroßvater verließ damals seine Frau und Tochter, um Musiker zu werden, seitdem fühlen sich die Riveras durch Musik verflucht. Doch Familie hin oder her – Miguel will seinem Idol, dem Sänger Ernesto de la Cruz, trotzdem nacheifern. Aus Versehen kommt er dabei ins Reich der Toten und betritt dadurch einen wunderschönen Ort, an dem er die Seelen seiner toten Verwandten trifft. Miguels Ururgroßmutter Imelda ist darunter, und das nette Schwindler-Skelett Hector. Zusammen suchen Skelett und Junge im Totenreich nach de la Cruz, wobei allerdings die Zeit drängt: Zu lange darf Miguel nicht in der Unterwelt bleiben…', 109, 'aYJ1ykLU4lQFv3yp7Nov7P1sxyf.jpg', NULL, '2017-10-27', 354912),
(17, 'Dunkirk', 'Mai 1940, der Zweite Weltkrieg tobt: Die Nazis haben die französische Hafenstadt Dünkirchen eingekesselt und verdeutlichen den Bewohnern und den 400.000 dort stationierten Soldaten mit Flugblättern die scheinbar ausweglose Lage. Denn durch die feindlichen Truppen auf der einen Seite und das Wasser auf der anderen scheint es keine Chance auf Überleben zu geben. Doch in Großbritannien ersinnt man eine kühne Rettungsmission, von der zuerst nur die wenigsten glauben, dass sie Aussicht auf Erfolg haben kann: Während die eingekesselten Soldaten, darunter Tommy, Alex und Gibson, am Boden ums Überleben kämpfen, sorgen RAF-Piloten wie Farrier in ihren Spitfires für Feuerschutz aus der Luft. Gleichzeitig eilen Zivilisten wie Mr. Dawson den eingekesselten Soldaten mit ihren kleinen Booten übers Wasser zu Hilfe.', 107, 'pcVC6wvEVodaUxkTsUkXlgVrXHF.jpg', NULL, '2017-07-19', 374720),
(18, 'Shot Caller', 'Nachdem Familienvater Jacob einen tödlichen Verkehrsunfall verschuldet hat, muss er ins Gefängnis. Sieben Jahre Haft stehen ihm bevor und die Gewalt im Knast lässt ihn beinahe verzweifeln. Also schließt er sich einer Gang an, die ihm innerhalb der Gefängnismauern Schutz vor den anderen Häftlingen garantiert. Doch diese Sicherheit hat ihren Preis - und der ist hoch. Als er nach Ablauf seiner Strafe wieder auf freien Fuß kommt, holt ihn seine Vergangenheit alsbald wieder ein, denn seine einstigen Beschützer fordern nun weitere Gefallen von ihm. Er soll eine rivalisierende Bande in den Straßen Südkaliforniens vernichten. Damit setzt ein knallharter Kampf ums Überleben ein, bei dem seine Familie zwischen die Fronten gerät...', 125, 'JTld2ZFWe7cnXK80W2BjcgmoGD.jpg', NULL, '2017-07-13', 339692),
(19, 'Baby Driver', 'Der Film handelt von einem talentierten jungen Fluchtwagenfahrer, der sich ganz auf den Beat seiner persönlichen Playlist verlässt, um der Beste in seinem Job zu werden. Als er das Mädchen seiner Träume trifft, sieht Baby eine Chance, seine kriminelle Karriere an den Nagel zu hängen und einen sauberen Ausstieg zu schaffen. Aber nachdem er gezwungen wird, für einen Gangsterboss zu arbeiten und ein zum Scheitern verurteilter Raubüberfall sein Leben, seine Liebe und seine Freiheit gefährdet, muss er für seine Handlungen geradestehen.', 113, 'sOpifmQ75PZMyrFcpzrw0LeBvjx.jpg', NULL, '2017-06-28', 339403),
(20, 'Spectral', 'Ein Straßenzug in einer kriegszerstörten Stadt: Die Soldaten, die hierhin gerufen wurden, mögen bestens ausgerüstet sein – aber gegen den Feind, dem sie nun begegnen, helfen keine herkömmlichen Waffen. Eine nahezu unsichtbare Macht tötet den Trupp, der Vorfall verlangt nach schnellen Antworten. Der Ingenieur Clyne wird von seinem Vorgesetzten damit beauftragt, für rasche Aufklärung zu sorgen. Zusammen mit einer Gruppe Elitesoldaten fährt er ins Kampfgebiet. Aus einem gepanzerten Wagen heraus verfolgt Clyne vorm Monitor, wie die Kämpfer in einen weiteren Hinterhalt geraten, ausgeführt von tödlichen Geistern. Die Männer versuchen, zu fliehen, aber die Evakuierung endet auf vermintem Gelände. Allein zwischen Trümmern müssen die Soldaten und der Ingenieur gegen Feinde kämpfen, die sie erst sehen, wenn es zu spät ist…', 108, '1X4LQGhPXh6sFmxWF4K46Gr7Wh3.jpg', NULL, '2016-12-09', 324670),
(21, 'Ben Hur', 'Der jüdische Prinz Judah Ben-Hur und der Sohn eines römischen Steuereintreibers Messala wachsen gemeinsam zu jener Zeit auf, zu der auch Jesus Christus lebt.  Sie sind beste Freunde, bis Messala eines Tages nach Rom geht, um sich dort weiterzubilden. Jahre später kommt er als völlig veränderter Mensch zurück, hat nur noch Spott für Judah und vor allem für dessen Religion übrig. Schon bald intrigiert er gegen seinen einstigen Freund und sorgt dafür, dass dessen Familie im Gefängnis landet und Judah auf ein Sklavenschiff gebracht wird. Der dort dem sicheren Tod geweihte Ben-Hur überlebt wie durch ein Wunder und kennt nur noch ein Ziel: Rache. Die bietet sich schließlich bei einem Wagenrennen in Rom, an welchem Ben-Hur im Dienste des ihm wohlgesonnenen Scheichs Ilderim teilnimmt ...', 123, 'eKDp1MndIye89hAfAq5Fykn2bPC.jpg', NULL, '2016-08-17', 271969),
(22, 'Passengers', 'Während einer Routinereise durch das All zu einem neuen Heimatplaneten erwachen zwei Passagiere aufgrund einer Fehlfunktion ihres Raumschiffs 90 Jahre zu früh aus dem Kälteschlaf. Jim und Aurora steht nun bevor, ihr gesamtes restliches Leben an Bord dieses Raumschiffs verbringen zu müssen. Umgeben von jedem nur denkbaren Luxus, fühlen sie sich stark zueinander hingezogen und verlieben sich ineinander. Doch plötzlich entdecken sie, dass sich ihr Raumschiff in großer Gefahr befindet. Das Leben von 5.000 schlafenden Passagieren steht auf dem Spiel – und nur Jim und Aurora können sie retten.', 116, '1Vxbkcjia3oEmRtnaHqZ8jHWaz1.jpg', NULL, '2016-12-21', 274870),
(23, 'Hidden Figures - Unerkannte Heldinnen', 'Hidden Figures ist die unglaubliche, noch nie erzählte Geschichte von Katherine Johnson, Dorothy Vaughn und Mary Jackson herausragende afro-amerikanische Frauen, die bei der NASA gearbeitet haben und in dieser Funktion als brillante Köpfe einer der größten Unternehmungen in der Geschichte gelten: Sie haben den Astronauten John Glenn in die Umlaufbahn geschickt. Eine fantastische Errungenschaft, die der Nation neues Selbstbewusstsein gab, das Rennen im Weltall neu definierte und die Welt aufrüttelte. Dieses visionäre Trio überschritt jegliche Geschlechts- und Rassengrenzen und inspirierte Generationen, an ihren großen Träumen festzuhalten.', 127, '5vcKIRgaGI2IBXCid0M5TqABnrd.jpg', NULL, '2016-12-10', 381284),
(24, 'Hacksaw Ridge - Die Entscheidung', 'Die wahre Geschichte über den amerikanischen Army-Sanitäter Desmond T. Doss, der sich im Zweiten Weltkrieg freiwillig als Soldat meldete, aber keine Waffen tragen wollte. Zunächst für seine Weigerung vors Kriegsgericht gestellt, durfte er schließlich doch am Pazifikkrieg teilnehmen. Während eines Angriffes auf seine Einheit wuchs er über sich hinaus und rettete im Kampf um Okinawa ohne fremde Hilfe und unter ständiger Bedrohung durch den Gegner mehr als 75 seiner Kameraden vor dem Tod. Hierfür  wurde ihm als erstem Soldaten, der den Dienst an der Waffe verweigerte, die „Medal Of Honor“ verliehen.', 140, '7E5XUlhcka6iTIFTrA4K7SkM1cd.jpg', NULL, '2016-10-07', 324786),
(25, 'The Invitation', 'Will und Eden waren einst ein glückliches Pärchen. Nachdem die beiden jedoch ihren gemeinsamen Sohn auf tragische Weise verloren hatten, hat sich Eden ohne jede Vorwarnung und irgendwelche Spuren zu hinterlassen aus dem Staub gemacht. Zwei Jahre später taucht sie urplötzlich mit einem neuen Ehemann im Gepäck wieder auf und möchte sich als neuer Mensch mit ihrem Ex und all jenen, die sie einst hinter sich gelassen hat, aussöhnen. Bei einer Dinner-Party in dem Haus, das früher auch ihm gehört hat, wird Will allerdings das ungute Gefühl nicht los, dass Eden und ihr neuer Mann in Wahrheit weitaus finsterere Pläne für ihre geladenen Gäste haben. Spielen ihm seine Sinne einen Streich oder ist Eden wirklich nicht das, was sie vorgibt zu sein?', 100, 'eemzlQ4e9PkZ6cnqsraYsODcX8Z.jpg', NULL, '2015-08-05', 306947),
(26, 'Victoria', 'Mitten in der Nacht lernt die junge Spanierin Victoria vor einem Club in Berlin die vier Freunde Sonne, Boxer, Blinker und Fuß kennen. Schnell kommen sich die Frau aus Madrid und der draufgängerische Sonne näher. Doch für die Jungs fängt die Nacht gerade erst an. Um eine Schuld bei Gangster Andi begleichen zu können, sehen sich die Vier gezwungen, eine krumme Sache durchzuziehen. Als einer aus der Gruppe schließlich unerwartet ausfällt, soll ausgerechnet Victoria als Fahrerin bei der heiklen Unternehmung einspringen. Was für sie zunächst wie ein spannendes Abenteurer klingt, entwickelt sich rasch zum Albtraum, denn der geplante Coup geht gründlich schief und das junge Glück von Victoria und Sonne wird knallhart auf die Probe gestellt...', 134, 'fBzOlimdWy14HgwSSqZBxZnv1EB.jpg', NULL, '2015-06-11', 320007),
(27, 'Ant-Man', 'Als Hank Pym den smarten Superdieb Scott Lang für einen großen Coup anwirbt, setzt der Knastveteran seine Qualitäten erstmals für das Gute ein. Um zu verhindern, dass Pyms Technologie, mit der Belebtes und Unbelebtes auf Miniaturgröße geschrumpft werden kann, militärisch genutzt wird, soll Lang die Fortschritte von Pyms skrupellosem Kontrahenten Cross sabotieren und dessen Spezialanzug stehlen. Doch dafür muss Lang ein Superheldentraining absolvieren und lernen, ein Heer von Ameisen für seine Mission Impossible zu kontrollieren ...', 117, 'i19WDSF030UObPPf60qkM0Hl03x.jpg', NULL, '2015-07-14', 102899),
(28, 'Maggie', 'Eine Epidemie fordert Millionen von Menschenleben in den Vereinigten Staaten. Zunächst machtlos, gelingt es der Regierung doch noch die Epidemie einzugrenzen - für die bereits Infizierten kommt allerdings jede Hilfe zu spät. Eine der letzten Infizierten ist die Schülerin Maggie, die binnen sechs Wochen zur Untoten mutieren wird. Für die ihr verbleibende Zeit kehrt sie in ihr Elternhaus, einer einsamen Farm im mittleren Westen zurück. Ihr Vater Wade will sich mit ihrem Schicksal nicht abfinden und sucht fieberhaft nach einem Heilmittel. Doch umso mehr Zeit verstreicht, umso deutlicher wird die Verwandlung und seine kleine Tochter wird zu seiner größten Gefahr!', 95, 'hPWetq3jXwiUY9YOzFjuAUOjus0.jpg', NULL, '2015-05-08', 287424),
(29, 'James Bond 007 - Spectre', 'James Bond erhält eine kryptische Nachricht aus seiner Vergangenheit, die ihn auf die Spur einer finsteren Organisation bringt. Bond muss immer mehr entdecken, dass es viele Täuschungen und Lügen gibt, die er entschlüsseln muss. Während sein Boss M mit anderen Problemen kämpft, mit politischen Kräften konfrontiert ist, die den ganzen Geheimdienst gefährden, erkennt Bond erst nach und nach die schreckliche Wahrheit hinter Spectre.', 150, 'zj8ongFhtWNsVlfjOGo8pSr7PQg.jpg', NULL, '2015-10-26', 206647),
(30, 'Lucy', 'Die junge Lucy soll eigentlich nur einen harmlos erscheinenden Koffer in einem Hotel abgeben. Bei der Übergabe wird jedoch ihr Freund ermordet und der Inhalt stellt sich als neuartige Droge heraus. Der Empfänger, ein skrupelloser Drogendealer, zwingt sie, ein Paket der Droge in ihrem Körper nach Europa zu transportieren. Doch der Kurierdienst schlägt fehl und die gesamte Drogendosis gerät in Lucys Blutbahn. Wie durch ein Wunder kommt sie dabei nicht ums Leben, stattdessen entwickelt sie ungeahnte Kräfte.', 90, 'kRbpUTRNm6QbLQFPFWUcNC4czEm.jpg', NULL, '2014-07-25', 240832),
(31, 'Joe - Die Rache ist sein', 'Der ehemalige Verbrecher Joe lebt einfach so in seinen ungeordneten Alltag hinein, betrinkt sich regelmäßig und versucht, nicht noch einmal in Schwierigkeiten zu geraten. Er nimmt einen Job in der Forstwirtschaft an und fällt einen Baum nach dem anderen. Doch eine Begegnung reißt ihn aus seinem täglichen Trott: Joe trifft den 15-jährigen Gary, der gerne für und mit Joe im Wald arbeiten möchte. Nicht begeistert über die Gesellschaft, aber empfänglich für die Hilfe, nimmt Joe den jungen Helfer unter seine Fittiche. So entdecken der ältere und der junge Mann eine gewisse Seelenverwandtschaft, die Joe vor eine unangenehme Situation stellt. Denn Garys Vater Wade ist gewalttätig und vernachlässigt seinen Sohn, den Joe auf keinen Fall verrohen sehen will.', 117, 'jDjxnenonu2wKdxEkctMAcY6IRt.jpg', NULL, '2014-04-11', 157847),
(32, 'Tusk', 'Für seinen Podcast reist Wallace durch Amerika und trifft sich mit vielen interessanten Menschen, die ihm ihre Lebensgeschichte erzählen wollen. Eines Tages erhält er einen Brief von einem alten Seefahrer namens Howard Howe und Wallace folgt der Einladung des alten Mannes nach Kanada. Als er dort eintrifft, offenbart im Howard eine schier unglaubliche Geschichte. Noch bevor der Journalist seinen Tee austrinken kann, fällt er betäubt in Ohnmacht und wird von Howard auf dessen Anwesen festgehalten, um von diesem Stück für Stück transformiert zu werden - in ein Walross! Während dieser Zeit sorgen sich Wallace Freundin Ally und sein bester Freund Teddy um ihn und entschließen sich, seinem Verschwinden auf den Grund zu gehen.', 102, 'pA2SgITmH0lzet9Nn5cxeinRKMv.jpg', NULL, '2014-09-19', 246403),
(33, 'Automata', 'In der Zukunft steht die Welt endgültig am Rande einer ökologischen Katastrophe. Gleichzeitig ist die Menschheit so weit entwickelt, dass sie künstliche Intelligenzen und Roboter erschafft. Jacq Vaucan ist Versicherungsagent bei ROC, dem Konzern hinter der Schöpfung jener Maschinen, und untersucht routinemäßig einige Fälle von Roboter-Fehlfunktionen. Als er feststellt, dass diese auf mutwillige Manipulation zurückführen sind, stößt er auf Dinge, die das Schicksal der Menschheit verändern könnten. Was ist, wenn Maschinen sich selbst reparieren, ihre eigene Programmierung ändern? Es könnte dazu führen, dass sie auch ein eigenes Bewusstsein entwickeln. Doch diese Vorstellung ist für die Menschen, die mittlerweile von Robotern umgeben leben, derart beängstigend, dass entsprechende Gegenmaßnahmen unausweichlich scheinen...', 109, 'bgJ83HsNuDQws4YiIJqx9L2qT5s.jpg', NULL, '2014-10-09', 262543),
(34, 'The Signal', 'Die begeisterten Hacker Nick und Jonah sind gerade in ihrem ersten Jahr auf dem MIT, als sie eine Fehde mit dem verfeindeten Hacker Nomad gemeinsam mit Nicks Freundin Hailey knapp 300 Kilometer landeinwärts führt: mitten in eine Wüste. Nach einer verstörenden Begegnung mit Nomad wachen sie plötzlich in einem mysteriösen Forschungslabor auf. Die kleine Gruppe wird von einem ominösen Mann namens Dr. Wallace Damon nach einem seltsamen Signal ausgefragt. Mit der Zeit merken die Studenten, dass sie sich verändert haben und neue unerklärliche Kräfte in ihnen schlummern. Die bedrohliche Atmosphäre veranlasst Nick, Jonah und Hailey schließlich zur Flucht aus der geheimnisvollen Forschungsanlage. Doch Polizei und Militär nehmen die Verfolgung auf…', 97, 'zKWpPYsEqz1wx19UxFFtBhAoPVi.jpg', NULL, '2014-03-15', 242095),
(35, 'Das ist das Ende', 'Während einer Party im Haus von James Franco müssen Jay Baruchel, Seth Rogen und einige andere Berühmtheiten feststellen, dass draußen seltsame Dinge vor sich gehen, wie zum Beispiel unerklärliche Erdrutsche und Feuerwände, die durch die Gegend walzen. Der Großteil der Partygäste entschließt sich dazu, panisch zu flüchten, während sechs Freunde beschließen, sich in Francos Haus zu verbarrikadieren. Bald jedoch sinkt die Stimmung bei ihnen ins Bodenlose, denn die Vorräte schwinden, alle benehmen sich völlig daneben und plötzlich taucht auch noch Emma Watson auf. Vor der Tür häufen sich schließlich die merkwürdigen Vorfälle und drinnen ist die Gemütslage alsbald ähnlich apokalyptisch. Schließlich beschließen James Franco und Co., das Haus zu verlassen und sich dem vermeintlichen Weltuntergang zu stellen - ganz nebenbei erkennen sie den wahren Wert von Freundschaft.', 107, 'ezjfAbHP9ijaJTUxFAEMYCfeLVx.jpg', NULL, '2013-06-12', 109414),
(36, 'Snitch - Ein riskanter Deal', 'Als der 17-jährige Jason ein Paket mit Ecstasy-Pillen entgegennimmt, das ihm ein „guter Freund\" zugeschickt hat, soll er wegen Drogenhandels für zehn Jahre hinter Gitter -- das Mindeststrafmaß für Drogendelikte in den USA! Um ihn vor dieser drakonischen Strafe zu bewahren, vereinbart sein alarmierter Vater John mit der resoluten Staatsanwältin einen sogenannten „Snitch\": Sollte es John gelingen, einen der Drogenbosse ans Messer zu liefern, kommt sein Sohn frei.', 112, 't928e9q8Mxjw0tQvQ3q0LiuAGAz.jpg', NULL, '2013-02-21', 134411),
(37, 'Evil Dead', 'Mia und ihr Bruder David freuen sich auf ein paar freie Tage, die sie mit ihren Freunden Olivia, Eric und Natalie in einer entlegenen Waldhütte verbringen wollen: Doch dann entdecken die fünf jungen Leute dort das in Menschenhaut gebundene Necronomicon, \"Das Buch des Todes\". Als Eric einige der mit Blut geschriebenen Passagen übersetzt, befreit er die Dämonen, die sich der jungen Leute nach und nach bemächtigen. Mia sieht in ihren Visionen den Schrecken kommen, doch ihr wird nicht geglaubt, bis sich schließlich der Wald rund ums Haus selbst gegen die Besucher erhebt und niemand mehr sicher ist.', 91, 'AhditfgkjrA6PpyzIMEaLGHkufj.jpg', NULL, '2013-04-05', 109428),
(38, 'Mama', 'Fünf Jahre waren die jungen Nichten von Lucas verschwunden. Als sie in einer Waldhütte entdeckt werden, sind sie völlig verwildert, verängstigt und aggressiv. Lucas nimmt sich mit seiner Verlobten den zwei Mädchen an. Noch ahnt er nicht, dass deren Aussage, von einer Erscheinung, die sie \"Mama\" nennen, beschützt worden zu sein, kein Produkt einer traumatisierten Psyche ist. \"Mama\" existiert, bleibt auch im neuen Heim der Mädchen präsent und reagiert auf jede Störung der Mutter-Kind-Beziehung mit tödlicher Konsequenz.', 96, 'oI0FRI6UcS7st8QJmBC8Pov2mix.jpg', NULL, '2013-01-17', 132232),
(39, 'Horns', 'Ignatius Perrish hatte alles: Er war angesehen, wohlhabend und hatte eine wunderschöne Freundin. Doch eines Tages wird seine Freundin Merrin Williams vergewaltigt und ermordet aufgefunden. Obwohl man ihm vor Gericht nichts nachweisen konnte, blieb er als einziger Verdächtiger des Mordfalls zurück, was ihm zum sozial geächteten Außenseiter werden ließ. Sein Schicksal nimmt eine unerwartete Wendung, als er eines Morgens mit Hörnern aufwacht, die ihm aus den Schläfen herauswachsen. Diese Hörner geben ihm die Fähigkeit, die Sünden und geheimen Abgründe seiner Mitmenschen zu erkennen, indem er sie berührt. Um seine Unschuld zu beweisen, muss Perrish seine Hörner nutzen, um den wahren Mörder seiner Freundin ausfindig zu machen und der Gerechtigkeit zuzuführen. Auch wenn er dabei auf teuflische Hilfe zurückgreifen muss.', 120, 'ldywME8eLiJHzA8YlXJiovst5od.jpg', NULL, '2013-09-06', 149509),
(40, 'Safe - Todsicher', 'Luke Wright ist ein zweitklassiger Cage-Fighter in New Jersey. Als er einen manipulierten Kampf nicht wie gewünscht zu Ende bringt, statuiert die russische Mafia ein Exempel an ihm. Seine Frau wird brutal ermordet und auch alle ihm nahestehenden Personen schweben plötzlich in akuter Lebensgefahr. Völlig am Ende flieht Wright mit letzter Kraft nach New York und fristet dort ein trostloses, völlig isoliertes Dasein. Erst Mei, ein zehnjähriges chinesisches Mädchen, gibt seinem Leben wieder einen Sinn. Mei hat besondere mathematische Begabungen und kann sich auch größte Zahlen auf Anhieb vollständig merken. Diese Fähigkeit brachte sie in die Fänge des Triadenboss Han Jiao, der das Mädchen nach New York entführte und sie dort mit einem streng geheimen Code betraute. Der Zweck der Nummer wurde ihr nicht gennant, die Information scheint jedoch äußerst brisant zu sein ...', 94, 'kOCpkoMUVae9UIf85gO71SyjLbW.jpg', NULL, '2012-04-16', 72387),
(41, 'Alexandre Ajas Maniac', 'Frank ist Besitzer eines Ladens für Schaufensterpuppen. Er lebt ein eher zurückhaltendes und verschlossenes Leben. Doch dies ändert sich, als die junge und hübsche Anna in sein Leben tritt. Für ihre neue Ausstellung wendet sie sich an Frank. Aus dem Treffen entwickelt sich eine Freundschaft. Doch der Schein trügt. Denn unter der Oberfläche verstärkt sich seine geheime Besessenheit. Je länger die Freundschaft anhält, desto heftiger tritt seine Manie zum Vorschein.', 93, 'A06MWAkgsiLZHWGTPdnRpRigKr5.jpg', NULL, '2012-12-26', 103620),
(42, 'Der Chaos-Dad', 'Donny feiert sich und sein Leben, ohne dabei auf seine finanzielle Situation Rücksicht zu nehmen. Als er jedoch erfährt, dass er 43.000 Dollar Steuerschulden hat und kurz davor ist, alles zu verlieren, sieht sich der Trinker vor dem Aus und schon mit einem Bein hinter Gittern. Doch eines Abends sieht er das Bild seines Sohnes Todd in der Zeitung. Donny hat schon vor Jahren den Kontakt abgebrochen. Aus seinem Sprößling scheint etwas geworden zu sein, denn Todd ist nun ein vermögender Anwalt und steht kurz vor der Hochzeit mit seiner ebenso reichen Freundin. Da Donny drei Jahre Haft drohen, wenn er das Geld nicht innerhalb kurzer Zeit auftreibt, beschließt er, seinem Sohn einen Besuch abzustatten. Aufgrund der Abneigung gegenüber der Freundin seines Sohnes will Donny ihn wieder zur Besinnung bringen. Kurz vor der Hochzeit durchleben Vater und Sohn die wildesten Eskapaden - mit viel Alkohol und Drogen.', 114, 'nYRBos8YpkJ90HhC61ZuupwCnz1.jpg', NULL, '2012-06-14', 87428),
(43, 'Les Misérables', 'Valjean, der 19 Jahre für den Diebstahl eines Laibes Brot verbüßt hat, macht nach seiner Freilassung eine tiefgreifende religiöse Erfahrung. Er taucht unter und hat sich acht Jahre später zum wohltätigen Fabrikbesitzer gewandelt. Nach dem Tod von Fantine, die sich und ihre Tochter Cosette als Prostituierte durchbringen musste, kümmert sich Valjean um das Mädchen. Als junge Frau verliebt sich Cosette in den passionierten Revolutionär Marius. Die Revolte endet im Blutbad, dank Valjeans Edelmut werden die jungen Liebenden jedoch vereint.', 152, 'mdBCYOUtWG8FtlUD2fRCgUoT0Py.jpg', NULL, '2012-12-18', 82695),
(44, 'Battleship', 'Ein internationaler Flottenverband aus fünf Kriegsschiffen führt gerade eine Übung im pazifischen Ozean durch. Admiral Shane erblickt während eines Manövers ein metallenes Gebilde, das sich bei näherer Betrachtung als außerirdisches Raumschiff entpuppt, das aus dem Wasser ragt. Die Militärs reagieren mit großer Neugier auf das unbekannte Objekt. Als sich die ersten Offiziere dem gewaltigen Raumschiff nähern, erwecken sie es zum Leben. Admiral Shane und sein Schwiegersohn in spe, Alex Hopper, gehen auf Angriffskurs und stellen sich den ungebetenen Gästen in die Quere. Doch die entfesselte Seeschlacht ist nur der Anfang. Denn die Aliens, \"Regents\" genannt, wollen eine gewaltige Energiequelle auf dem Meer errichten - und die Menschheit scheint ihnen dabei im Weg zu stehen...', 131, 'iPcKGENr2JciyNqmiMNJGerVWO.jpg', NULL, '2012-04-11', 44833),
(45, 'Colombiana', 'Cataleya ist erst neun Jahre alt, als sie die Ermordung ihrer Eltern durch den brutalen kolumbianischen Mafiaboss Don Luis mit ansehen muss. Sie selbst entgeht dem Anschlag nur knapp und es gelingt ihr, zu ihrem Onkel nach Chicago zu fliehen. Getrieben von dem Wunsch nach Rache und fest entschlossen, den Mörder ihrer Eltern aufzuspüren, lässt sie sich zur Profi-Killerin ausbilden. Doch Don Luis genießt inzwischen den Schutz der CIA. Bei dem Versuch, ihren Erzfeind aus der Reserve zu locken, gerät auch Cataleya immer mehr ins Fadenkreuz des FBI sondern auch Danny, der von den dunklen Machenschaften seiner Freundin nichts ahnt...', 108, 'saKpBNHXZnn3Mi7gPbQq2XgI1vu.jpg', NULL, '2011-07-27', 62835),
(46, 'The Roommate', 'Die süße Sara tritt erwartungsvoll ihr erstes College-Semester an. Alles scheint zunächst perfekt, auch ihre neue Zimmernachbarin Rebecca. Schnell werden die beiden zu besten Freundinnen, die alles zusammen unternehmen. Aus der Freundschaft wird bitterer Ernst, als sich herausstellt, dass Rebecca ein schwerwiegendes psychisches Problem hat. Die hübsche Brünette ist geradezu von Sara besessen. Aus Eifersucht beginnt Rebecca damit, jeden auszuschalten, der Sara nahe steht.', 91, 'kQZcOn5rDuwpbQTluC4Wm0amYmR.jpg', NULL, '2011-02-04', 49950),
(47, 'Pirates of the Caribbean - Fremde Gezeiten', 'In Pirates Of The Caribbean – Fremde Gezeiten begegnet Captain Jack Sparrow einer Frau aus seiner Vergangenheit wieder. Angelica heißt die Schöne und Sparrow war in sie verliebt. Oder hat sie ihn nur benutzt? Jedenfalls schickt Angelica den Piraten auf die Suche nach dem sagenumwobenden Jungbrunnen. Dazu muss er an Board der Queen Anne’s Revenge gehen, dem Schiff des gefürchteten Piraten Blackbeards. Captain Jack Sparrow findet sich in Fluch der Karibik 4 wie erwartet in einer abenteuerlichen Geschichte wieder, in der er nicht mehr weiß, wem er vertrauen kann: dem skrupellosen Piraten Blackbeard oder der schönen Frau aus seiner Vergangenheit. Captain Hector Barbossa kann ihm auch nicht wirklich auf die Sprünge helfen, sondern ist eher eine weitere Störung auf der Suche nach dem Jungbrunnen…', 137, 'uVLWxcVYI0hemweRPmp45DHF2pn.jpg', NULL, '2011-05-14', 1865),
(48, 'Gregs Tagebuch 2 - Gibt\'s Probleme?', 'Der naseweise Greg Heffley ist ein Jahr älter und kommt in die siebte Klasse. Doch sonst bleibt alles beim Gleichen. Wie im Vorjahr ist er Zielscheibe von Schikanen der Schulhofrüpel und seinem Bruder Roderick. Da hilft es wenig, dass ihre Mutter eine Belohnung dafür aussetzt, wenn er und Roderick gut miteinander auskommen. Dann ist da auch noch die neue Schülerin Holly. Greg hat sich in sie verguckt, doch sie würdigt ihn keines Blickes.', 99, 'drvisywZdIvcNqvH2AOClSJ6BXG.jpg', NULL, '2011-03-25', 60307),
(49, 'The Tourist', 'Frank ist The Tourist, ein Amerikaner auf dem Weg nach Italien, um sich nach einer schmerzhaften Trennung ein wenig abzulenken. Die Ablenkung folgt auf den Fuß, als er im Zug nach Venedig der atemberaubenden Elise begegnet. Es dauert nicht lange und er ist Hals über Kopf in die schöne Unbekannte verliebt. Was Frank jedoch nicht weiß: Das Ganze war keine zufällige Begegnung, sondern Elise hat sich Frank ganz bewusst ausgesucht, um die Verfolger ihres Ex-Freundes Alexander Pearce in die Irre zu führen. Dieser ist nämlich nicht nur ein Gangster, der in vierzehn Staaten gesucht wird, sondern Alexander ist auch noch im Besitz von gestohlenem Geld, das jemand wieder haben möchte. Von einem Moment auf den anderen findet sich Frank in The Tourist deshalb in der Situation, nicht nur von einem Agenten gejagt zu werden, sondern auch noch zum Ziel eines Gangsters geworden zu sein.', 103, '54TV2S0BN3kyxqhPZgOsYGngPrf.jpg', NULL, '2010-12-08', 37710),
(50, 'Kiss & Kill', 'Nach einer weiteren verkorksten Beziehung ist Jen Kornfeldt sicher: Sie wird sich nie wieder verlieben! Aber dann reist sie mit ihren Eltern nach Nizza – und trifft ihren Mr. Right: den schönen und weltgewandten Spencer Aimes. Bald leben beide frisch verheiratet in einer ganz normalen amerikanischen Vorort-Idylle. Bis es am Morgen nach Spencers 30. Geburtstag zu einer klitzekleinen Vertrauenskrise kommt. Es stellt sich nicht nur heraus, dass Spencer ein internationaler Super-Spion war - plötzlich wird er auch von einer ganzen Armee von Auftragskillern gejagt! Während die beiden Kugeln ausweichen, die netten Verwandten auf Abstand halten und in der Nachbarschaft das glückliche Paar spielen, haben sie also auch eine Menge zu besprechen.', 100, '5bP1RKSTwrw69GJXQpMedyiOm79.jpg', NULL, '2010-06-04', 37821),
(51, 'True Grit', 'Die 14-jährige Mattie Ross ist fest entschlossen, den kaltblütigen Mord an ihrem Vater nicht ungesühnt zu lassen. Da die Behörden ihr nicht helfen, will sie den feigen Mörder Tom Chaney mit eigenen Mitteln seiner gerechten Strafe zuführen. Für 100 Dollar engagiert sie den trunksüchtigen und raubeinigen U.S. Marshall Rooster Cogburn, der es mit dem Gesetz selbst alles andere als genau nimmt. Widerwillig lässt er sich von Mattie überreden, sie auf die Jagd nach Chaney mit zu nehmen - quer durch die gesetzlosen Weiten der Prärie. Doch sie sind nicht allein, denn auch Texas Ranger LaBoeuf will den Flüchtigen stellen, um eine Kopfprämie zu kassieren, die auf Chaney wegen eines weiteren Mordes ausgesetzt ist. Unfreiwillig ziehen sie zu dritt weiter und schon bald kommt Mattie dem Mörder ihres Vaters gefährlich nah...', 110, 'rxeRwN7dxHSLE0asOEIc1Q5Mcxy.jpg', NULL, '2010-12-22', 44264),
(52, 'Karate Kid', 'Als Dre Parker mit seiner Mutter von Detroit nach Peking umziehen muss, ist für den 12-Jährigen plötzlich nichts mehr so, wie es mal war. Allein ohne Freunde in einem fremden Land, muss sich Dre in der Schule gegen den Klassenrüpel Cheng zur Wehr setzen, der ein geübter Kung-Fu-Kämpfer ist. Da Dre selbst aber nur über ein paar wenige Karate-Kenntnisse verfügt, kann er sich kaum verteidigen und wird von allen als \"Karate Kid\" verspottet. Dre hat niemanden, an den er sich wenden kann, außer dem Hausmeister Mr. Han, der insgeheim ein berühmter Kung-Fu-Meister ist und bald zu Dres Mentor wird. Han weiht Dre in die Kunst des Kung Fu ein und bereitet ihn auf ein Turnier vor, bei dem er auf seinen Rivalen Cheng treffen wird…', 140, 'tAMQREOoztvluqrfHiGHFVfB04B.jpg', NULL, '2010-06-10', 38575),
(53, 'It\'s Kind of a Funny Story', 'Eigentlich müsste Craig mit seinem Leben zufrieden sein. Der 16-Jährige ist gesund, hat Freunde, lebt in einer intakten Familie und geht an eine renommierte Privatschule. Und dennoch stimmt etwas nicht mit ihm. Craig plagen seit einiger Zeit Selbstmordgedanken. Diese werden so konkret, dass er sich freiwillig in eine Brooklyner Nervenheilanstalt einweisen lässt. Dort stellt man ihn fünf Tage unter Beobachtung – allerdings in der Erwachsenenstation, denn die Abteilung für Jugendliche wird gerade renoviert. Zwischen den schwer gestörten Mitpatienten fühlt sich Craig völlig fehl am Platz, bis er die Bekanntschaft mit dem sympathischen Bobby macht. Der Spaßvogel nimmt den Jungen unter seine Fittiche. Doch Bobby verschweigt Craig seine eigenen Probleme, die plötzlich in aller Heftigkeit zum Vorschein kommen.', 101, 'jAIoL0275PFrx9jrmneWAqmBvtD.jpg', NULL, '2010-10-08', 43923),
(54, 'Pandorum', 'Die Astronauten Payton und Bower erwachen aus einem Tiefschlaf und finden sich an Bord eines riesigen Raumschiffs wieder. Ihre Erinnerung ist komplett ausgelöscht: Weder wissen sie, wie lange sie geschlafen haben, noch, warum sie hier sind. Doch ihnen bleibt nicht viel Zeit zum Überlegen, denn das Energiesystem des Raumschiffs steht kurz vor dem Zusammenbruch. Per Funk lotst Payton Bower durch enge Luftschächte zum Reaktor, damit er diesen reparieren kann. Schnell wird klar, dass die beiden nicht allein sind und sich in großer Gefahr befinden.', 108, '9SkZkXKlwHgdxsnz0vmPFAkBS1o.jpg', NULL, '2009-09-08', 19898),
(55, 'Freitag der 13.', 'Am Crystal Lake, da lässt es sich gut feiern, baden und poppen. Das denken sich Whitney, Mike Wade, Richie und Amanda, die ein paar Tage in der Natur verbringen wollen. Serienkiller Jason Vorhees  aber hat etwas gegen das unbeschwerte jugendliche Treiben und stattet den jungen Leuten einen Besuch ab – die Machete im Gepäck. Sechs Monate später macht sich Whitneys Bruder Clay verzweifelt auf die Suche nach seiner Schwester. Von der gesamten Gruppe findet sich keine Spur und die Polizei ist auch keine Hilfe. Clay trifft kurz nach seiner Ankunft eine weitere unvorsichtige Reisegruppe.', 97, 'ssEGpT88hUSwU27ZlhBa4BE22Zo.jpg', NULL, '2009-02-11', 13207),
(56, 'Moon', 'Sam Bell ist der Mann im Mond, oder besser: Der einzige Mann auf dem Mond. Nach drei langen Jahren steht er kurz vor der Ablösung, seine monotone Wartungsarbeit hat der Astronaut längst über. Schließlich hat die Lunar Corporation, die die Energieprobleme der Erde mit einem Schlag gelöst hat, noch andere Mitarbeiter – Sam will nun bloß noch zurück zu Frau und Tochter. Doch als er plötzlich auf einen weiteren Mondbewohner stößt, dessen Präsenz sich selbst Bordcomputer Gerty nicht erklären kann, gerät Sam kurz vor seiner Rückkehr zur Erde in große Gefahr...', 97, 'cJ6JnuLwCNbiAAOBuHDjRTP7bQJ.jpg', NULL, '2009-06-12', 17431),
(57, 'Illuminati', 'Die Gefahr lauert im Geheimen. Während in Rom die Papstwahlen Gläubige auf der ganzen Welt in Atem halten, plant der untergegangen geglaubte und einst herausragend mächtige Geheimbund „Die Illuminati“ den entscheidenden Schlag gegen seinen alten Erzfeind: die katholische Kirche. Das zumindest findet der amerikanische Wissenschaftler Robert Langdon heraus, der keine Zeit verliert und sich in Rom mit der italienischen Kollegin Vittoria Vetra verbündet. Ein Wettlauf mit der Zeit auf der Suche nach altertümlichen Symbolen und der Rettung für den Vatikan beginnt.', 138, 'yGVoQ7nFCDE1uuqiZL6ZVSLOZKf.jpg', NULL, '2009-05-13', 13448),
(58, 'The Road', 'Die Welt wie wir sie kennen, gibt es nicht mehr. Nach einer globalen Katastrophe sind die wenigen Überlebenden auf der Suche nach Nahrung und Rettung. So auch ein Vater und sein Sohn. Sie durchstreifen Amerika, das ein von Schutt und Dreck bedecktes Ödland darstellt und wo kaum noch Pflanzen und Tiere existieren, mit einem Einkaufswagen bepackt mit ihrem letzten Hab und Gut. Sie gehen Richtung Süden, in der Hoffnung am Ozean eine bessere und lebenswertere Umgebung vorzufinden.', 111, 'qLaXnLzqleBWQtjvZ6JGVSaKoC3.jpg', NULL, '2009-11-25', 20766),
(59, 'The Fighters', 'Um seinen jüngeren Bruder bei seiner Tenniskarriere zu unterstützen, zieht Jake Tyler zusammen mit seiner Familie nach Orlando. In der neuen Stadt muss sich der einst angesehene Sportler zunächst zurechtfinden und erhofft sich auf einer Party seines Schwarms Baja Anschluss zu finden. Dort gerät er jedoch mit dem Raufbold Ryan aneinander, der ihm eine saftige Tracht Prügel verpasst. Kurz darauf erfährt er durch einen Schulkameraden von einem Kampfsport namens Mixed Martial Arts und lernt einen Trainer kennen. Dieser fördert Jake, bringt ihm Disziplin, Willensstärke und Kampftechniken bei und gibt ihm die Möglichkeit herauszufinden, wer er wirklich ist.', 110, 'mYkTq569KOtjdq5zo9mrEY6ecip.jpg', NULL, '2008-03-04', 8456),
(60, 'James Bond 007 - Ein Quantum Trost', 'Nach dem Tod von Vesper Lynd versucht James Bond an die Hintermänner des Komplotts gegen Lynd zu kommen. Beim MI6 wird dazu Mr. White verhört, dem durch einen internen Verrat während des Verhörs die Flucht gelingt. Die Spur führt Bond nach Haiti. Dort gelangt er durch die attraktive Camille an den zwielichtigen Dominic Greene, der mit dem Komplott in Verbindung zu stehen scheint. Bond muss fortan nicht nur einmal um sein Leben bangen...', 106, 'hlF1FIGZ8EBLU1pVHrdDY9ejmSX.jpg', NULL, '2008-10-31', 10764),
(61, 'Der Tag, an dem die Erde stillstand', 'Die Biologiewissenschaftlerin Helen Barnes wird von der US-Regierung in streng geheimer Sache konsultiert. Unbekannte Flugobjekte haben die Erde erreicht und die Absicht der außerirdischen Gäste ist noch unklar. Als Abgesandter der unbekannten Rasse aus dem Weltraum erscheint der unterkühlte Klaatu - dieser soll über das Schicksal der Menschheit entscheiden, die durch ihren zerstörerischen Charakter eine Gefahr für ihren fruchtbaren Heimatplaneten darstellt. Da eine Gefährdung aller Arten des Planeten durch eine einzige Spezies nicht länger zu erdulden ist, wird die Auslöschung der Menschen in die Wege geleitet.', 104, '801rXkNloWOnr5samGBAyrx1iBr.jpg', NULL, '2008-12-10', 10200),
(62, 'Wanted', 'Wesley Gibson ist ein langweiliger Durchschnittstyp, der gute Gründe hat, sein Leben zu hassen: seine Chefin schikaniert ihn pausenlos und seine Freundin schläft mit seinem besten Freund. Doch dann trifft er die aufregende Fox, gerät mitten in eine Schießerei und erfährt, dass sein verschollener Vater gerade erst brutal ermordet wurde. Wes lernt die Bruderschaft kennen, einen mächtigen Geheimbund, der die Geschicke der Menschheit lenkt. Das frühere Weichei entwickelt durch Fox’ knallharte Ausbildung blitzschnelle Reflexe und übermenschliche Geschicklichkeit. Schließlich tritt Wes in die Fußstapfen seines Vaters, um Rache zu nehmen. Doch auch die Bruderschaft hat eine dunkle Seite und Wes muss entscheiden, wer eigentlich über sein Leben bestimmen soll …', 110, 'cbDMsV4VJAL2xJ2JXdWWjmUXZkT.jpg', NULL, '2008-06-19', 8909),
(63, 'Leg dich nicht mit Zohan an', 'Keiner hat in seinem Heimatland Israel so viele Terroristen erledigt, wie Mossad-Superagent Zohan. Doch die Arbeit ist noch nicht erledigt. Sein neuester Auftrag bringt Zohan wieder mit seinem härtesten Widersacher zusammen, dem Top-Terroristen Phantom. Zohan erkennt in der Situation die einmalige Chance, seinen Lebenstraum zu verwirklichen: Das Multitalent möchte nach New York City gehen und dort als Friseur zu Weltruhm kommen – ein Vorhaben, für das er von seinen Eltern und Freunden nur ausgelacht wird. Deswegen inszeniert Zohan im Kampf gegen Phantom seinen eigenen Tod, verschwindet unerkannt und startet direkt in die USA durch. Blöd allerdings, dass Zohans Frisuren-Style-Buch, das er abends im stillen Kämmerlein studiert, schon 21 Jahre alt ist. Aber ein selbsternannter Meister seiner Größe steht selbstverständlich über solchen Kleinigkeiten!', 113, 'vjgbhLCHgrarzCivpC23ebEd8zx.jpg', NULL, '2008-06-05', 10661),
(64, 'Next', 'Unter dem Künstlernamen Frank Cadillac arbeitet Cris Johnson als Zauberer in Las Vegas. Was dabei kaum jemand weiß: er kann nicht nur Tauben aus dem Ärmel zaubern, sondern auch zwei Minuten seiner eigenen Zukunft im Voraus sehen. Als er eines Abend durch seine Fähigkeit einen Überfall in einem der Casinos verhindert, will ihm niemand glauben und so bleibt ihm nur die Flucht. Allerdings hat sich schon die Polizistin Callie an seine Fersen geheftet, obwohl sie ihn eher um eine andere Sache bitten möchte: Terroristen planen, eine Atombombe in Amerika zu zünden, und mit Cris\' Hilfe hofft sie, die Bombe zu finden, ehe sie Millionen Menschen das Leben kostet. Cris geht aber nicht auf die Bitte ein, da er zur Zeit seine ganze Aufmerksamkeit auf Liz richtet, die er in einem Diner kennen lernt.', 96, 'td5uOBW41ib1KGz3g1Kc33BdFyj.jpg', NULL, '2007-04-24', 1738),
(65, 'Halloween', 'Als der zehnjährige Michael Myers in der Nacht von Halloween zum ersten Mal mordet, sind die Bewohner der Kleinstadt Haddonfield in Illinois fassungslos. Nur zu gern möchte man diesen schrecklichen Vorfall schnell vergessen. Michael wird in eine geschlossene Anstalt gesteckt, wo Dr. Loomis jahrelang versucht, mit dem Jungen zu kommunizieren. Während sich Haddonfields Teenager Jahre später auf ein neues Halloween vorbereiten, flieht der inzwischen 25-jährige Michael aus der Anstalt. Und nun ist niemand mehr vor dem eiskalten Maskenmörder sicher.', 117, 'tpDizN9VUTETJLOxlVeIZxnmMwx.jpg', NULL, '2007-08-31', 2082),
(66, 'The Hitcher', 'Die Collegestudenten Grace und Jim befinden sich in Partylaune auf dem Weg in die Semesterferien, als bei strömenden Regen plötzlich ein mysteriöser Mann im Lichtkegel ihrer Scheinwerfer auftaucht und sich als John Ryder vorstellt. Trotz Vorbehalten seitens Grace nehmen die beiden den unbekannten Anhalter mit, bereuen dies allerdings sehr bald, denn der Unbekannte entpuppt sich als psychopathischer Serienkiller, der ein Katz-und-Maus-Spiel mit dem Pärchen beginnt. Grace und Jim gelingt zunächst die Flucht, aber der Hitcher zieht auf der Jagd nach ihnen eine blutige Spur der Vernichtung hinter sich her. Gibt es für die beiden Studenten ein Entkommen aus diesem furchtbaren Albtraum?', 84, 'aWWrTkEk3seGKK8c725jNDx9AEh.jpg', NULL, '2007-01-19', 8398),
(67, 'Sunshine', 'In fünfzig Jahren stirbt die Sonne – und mit ihr stirbt die Menschheit. Unsere letzte Hoffnung: ein Raumschiff, die Icarus II, mit einer Besatzung von acht Männern und Frauen. Sie transportieren eine stellare Atombombe, mit der sie unserem Stern neues Leben einhauchen wollen. Von ihren Vorgängern an Bord der Icarus I, die bei einem ersten Versuch scheiterten, hat man nie wieder etwas gehört… bis jetzt: Als die Crew tief in den Weiten des Alls, ohne Funkverbindung zur Erde, das Notsignal der Icarus I empfängt, gerät ihre Mission durch einen fatalen Fehler in tödliche Gefahr.', 107, 'y4X9s4bpBlIs5r3PAgR6YfyBkBD.jpg', NULL, '2007-04-05', 1272),
(68, 'Die Vorahnung', 'Der Tag ist für Linda Hanson völlig normal verlaufen, bis ein Polizist an ihrer Tür klingelt. Mit der Nachricht vom Unfalltod ihres Mannes Jim bricht für die zweifache Mutter eine Welt zusammen. Traumatisiert schläft sie ein, nur um am nächsten Tag einen noch größeren Schock zu erleben: Jim sitzt quicklebendig am Küchentisch. Zunächst glaubt Linda geträumt zu haben, doch am Morgen darauf ist sein Tod wieder grausame Realität. Als sich Déjà-vu-Vorfälle häufen, erkennt Linda, dass ihre Erlebnisse offenbar nur die Visionen von Ereignissen sind, die erst in der Zukunft geschehen werden. Aber kann sie Jims Tod verhindern?', 96, 'IahMQZif1FcMBoChS58yHO1679.jpg', NULL, '2007-02-08', 9963),
(69, 'James Bond 007 - Casino Royale', 'Sein erster Auftrag, nachdem er die Lizenz zum Töten erhalten hat, führt den MI6-Agenten James Bond nach Madagaskar, wo er auf den Terroristen Mollaka angesetzt wird. Zwar verläuft nicht alles nach Plan, doch als Bond auf eigene Faust weiter ermittelt kommt er auf die Spur von Le Chiffre, dem Bankier einer weltweit operierenden Terror-Organisation. Dieser plant, das Vermögen seiner Organisation durch ein illegales Pokerspiel im „Casino Royale“ von Montenegro um ein vielfaches zu erhöhen, wofür natürlich auch ein hoher Einsatz nötig ist. Der MI6 sieht daher die Chance, die Terroristen in den finanziellen Ruin zu treiben und beauftragt James Bond, die Pläne von Le Chiffre zunichte zu machen.', 144, 'uvigE215SzXdsEFPN0XRFR9RPiA.jpg', NULL, '2006-11-14', 36557),
(70, 'Der tierisch verrückte Bauernhof', 'Der idyllische Bauernhof eines veganischen Farmers. Dort kümmert sich das glückliche Vieh tagsüber ums Geschäft und feiert allnächtlich gewaltige Sausen. Die einzige Gefahr droht von den Kojoten der umliegenden Wildnis, die es aber nicht wagen, die vom weisen Rind Ben bestens organisierte Truppe anzugreifen. Das ändert sich rasch, als Bens Sohn Otis, ein ziemlicher Hallodri, dessen Aufgaben übernehmen muss. Und zu allem Überfluss dämmert gerade jetzt auch dem Hofbesitzer, was sich so alles auf seinem Besitz abspielt.', 90, 'teURlBUxOvSvrULAn8fme7zFO2O.jpg', NULL, '2006-08-04', 9907),
(71, 'Jackass: Nummer Zwei', 'Erneut trommelt Johnny Knoxville seine durchgeknallten Kumpels zusammen, um neue Widerlichkeiten und halsbrecherische Action auf Zelluloid zu bannen. Neben den altbewährten Stunts mit dem Einkaufswagen, bietet der Film einen Stierkampf mit blindem Matador, ein schmerzhaftes Zusammentreffen zwischen einem Krebs und einer Zunge sowie das Ziehen eines Zahnes mit der naturgemäß schmerzarmen Nylonfaden-Methode. Das oftmals mit Blessuren und anderen unschönen Nebenerscheinungen. Man kann auch bei diesem Streifen wirklich nur wiederholen: \"Don\'t try this at home!\".', 92, 'lpbSubVQN1pr0ivNHdszhqLqvA7.jpg', NULL, '2006-09-22', 12094),
(72, 'Tristan & Isolde', 'Britannien im sechsten Jahrhundert: das Land ist in zahlreiche Hoheitsgebiete der Angeln, Pikten, Kelten oder Juden zerfallen und steht unter der Knute der Iren. Der Versuch eines Bündnisses wird durch ein Attentat der Iren vereitelt, der junge Tristan von Aragon überlebt und wird von dem Fürst von Cornwall, Marke an Kindesstatt aufgenommen. Jahre später ist er ein mutiger junger Mann geworden, der einen weiteren Verschleppungsversuch der Iren vereitelt, dabei aber an einer vergifteten Klinge anscheinend stirbt. Sein Totenboot treibt an die irische Küste, wo er von Isolde, der Tochter des irischen Königs gefunden und gesund gepflegt wird, ohne ihren Namen zu erfahren. Die beiden verlieben sich unsterblich ineinander...', 125, 'AlrH53hsH0hsQ5GNp1Ip0GZetth.jpg', NULL, '2006-04-07', 9044),
(73, 'The Texas Chainsaw Massacre: The Beginning', 'Thomas Hewitt, der 1969 als junger Erwachsener in einem Schlachthaus arbeitet, wird zum Mörder seines Chefs, als dieser die Schließung des Schlachthauses verkündet. Der Sheriff, der den Mordfall untersucht, wird zum Opfer der Hewitts: Charlie Hewitt macht fortan in der Uniform des Sheriffs Jagd auf Durchreisende, Thomas Hewitt terrorisiert sie als \"Leatherface\" unter verschiedenen Masken aus der Haut seiner Opfer. Vor dem Hintergrund des Vietnamkriegs geraten zwei Brüder und ihre Freundinnen ebenso in die Hände der kannibalischen Menschenjäger, wie auch eine Gruppe von Rockern, mit denen sie im Clinch lagen.', 92, 'hTBueN0Ru3R7brwtONenDyEMNYe.jpg', NULL, '2006-10-06', 10781),
(74, 'Madagascar', 'Der eingebildete Löwe Alex, das vorlaute Zebra Marty, die ständig panische Giraffe Melman und die divenhafte Nilpferd-Dame Gloria sind die absoluten Stars im Zoo des New Yorker Central-Park. Doch Marty ist traurig: Zu sehr beschäftigt ihn der Gedanke an die Freiheit. Und als er eines Tages zufällig hinter den Fluchtversuch einiger Pinguine kommt, ist er kurz darauf verschwunden. Als sich alle vier Freunde nach einer tierisch rasanten Flucht durch das New Yorker U-Bahn-Netz, in Kisten verpackt auf einem Schiff wiederfinden, sind sie Martys Wunsch \"Zurück in die Wildnis\" unfreiwillig näher, als sie glauben: Vor der Küste der Insel Madagascar gehen sie erst über Bord, um gestrandet aus erster Hand zu erfahren, wie sich das wilde, neue Leben anfühlt.', 86, '7azuPQyGH4LMPBV4b2ZBkp0Tq5Q.jpg', NULL, '2005-05-25', 953),
(75, 'Ring 2', 'Sechs Monate nach den schrecklichen Ereignissen um das mysteriöse Videoband hat sich die Journalistin Rachel Keller mit ihrem Sohn Aidan in eine Kleinstadt namens Astoria zurückgezogen. Sie hat eine Stelle bei einer lokalen Zeitung angenommen und ist froh, sich in Ruhe der Erziehung ihres Sohnes zu widmen. Doch das Grauen scheint sie bis hierher zu verfolgen. Denn ganz in der Nähe stirbt ein Teenager auf ähnlich mysterise Art und Weise, wie sie es schon früher erlebt hat. Sie fährt zu dem Tatort und schleicht sich in den Leichenwagen, wo sie feststellen muss, dass der Tote eine schrecklich verzerrte Fratze hat, wie schon die früheren Opfer. Ihre schlimmsten Befürchtungen werden wahr, als auch ihr Sohn schreckliche Visionen hat und urplötzlich krank wird. Bei ihren Nachforschungen erhält sie Unterstützung von ihrem Arbeitskollegen Max.', 110, '5oYYt3JpgMEd8E19yXbWIk67jNV.jpg', NULL, '2005-03-17', 10320),
(76, 'Spiel ohne Regeln', 'Als der frühere Profi-Quarterback Paul “Wrecking” Crewe eine Haftstrafe wegen Körperverletzung abzusitzen hat, trifft er im Gefängnis auf den ehemaligen College-Champion und Trainer Nate Scarborough. Auf Weisung eines ebenso korrupten wie sadistischen Aufsehers muss Paul aus den Insassen ein Football-Team zusammenstellen, das bei einem Wettkampf Wärter gegen Gefangene antreten und um einen hohen Einsatz spielen soll. Doch schon bald muss der verwöhnte Ex-Profi feststellen, dass sich aus einem Haufen Rowdys so leicht keine Mannschaft formen lässt – zumal der Ausgang des großen Spiels bereits beschlossene Sache zu sein scheint. Also bittet er Nate um Hilfe. Gemeinsam wollen sie ihren Mitgefangenen und vor allem den Wärtern zeigen, wo der Hammer hängt!', 113, 'vybZHPs0Ura76ogKahozlC9innc.jpg', NULL, '2005-05-27', 9291),
(77, 'Die Familie Stone - Verloben verboten!', 'Bei den weihnachtlichen Feierlichkeiten in Neuengland, möchte Everett seiner Familie endlich seine neue Freundin vorstellen. Doch die etwas reservierte New Yorkerin Meredith, kommt bei der Familie nicht so gut an. Als sie unterstützenden Besuch von ihrer Schwester bekommt, gerät das Fest wirklich aus den Fugen und ein trauriges Geheimnis wird gelüftet.', 103, 'oAy356RzHQ72TxxGPc7VJfzRUHw.jpg', NULL, '2005-12-14', 9043),
(78, 'Die Maske 2 - Die nächste Generation', 'Der Comiczeichner und frisch gebackene Vater Tim Avery muß feststellen, daß sein Spross über unglaubliche Fähigkeiten verfügt, denn irgendwie hat das Baby Kontakt mit der berüchtigten Maske des Loki bekommen.', 94, '877cfV7U0I9laUSsi6QMMQgjQH0.jpg', NULL, '2005-02-18', 10214),
(79, 'New York Taxi', 'Geschwindigkeits-Fan Belle ist mit ihrem getunten Super-Taxi New Yorks schnellste Taxifahrerin. Undercover-Cop Andy ist der unfähigste Polizist und Auto-Fahrer der Stadt. Als vor seiner Nase vier attraktive Bankräuberinnen zuschlagen, rekrutiert Andy Belle, um die heißen Bräute zu verfolgen. Eine schräge und hochtourige Taxifahrt durch New York City beginnt, denn die Damen erweisen sich als sehr clever und gefährlich...', 97, 'tZyZnThoj9vjJmdL3nhKyyYhRC7.jpg', NULL, '2004-10-06', 11045),
(80, 'Darf ich bitten?', 'Im eigentlich zufriedenen Leben von Anwalt John Clark fehlt irgend etwas. Als er eines Abends einer attraktiven jungen Frau spontan in ein Tanzstudio folgt, erwacht eine ungeahnte Leidenschaft in ihm: Er meldet sich für einen Tanzkurs an und bereitet sich schon kurz darauf auf den größten Tanzwettbewerb Chicagos vor - sehr zur Verwunderung seiner Frau, die sich nicht erklären kann, wo ihr Gatte seine Freizeit verbringt.', 106, 'vRLiCzsyZ8cfspSf1yNt8Y72Ybu.jpg', NULL, '2004-10-15', 4380),
(81, 'Zwei Brüder', 'Jean-Jacques Annaud hat mit \"Zwei Brüder\" einen bildgewaltigen Film geschaffen, der zwar nur eine einfache Geschichte erzählt, aber eine wichtige Botschaft transportiert. Wie schon bei \"Der Bär\" konzentriert er sich auf seine tierischen Hauptdarsteller, lässt jedoch die menschliche Komponente nicht außer Acht und findet ein Ende, das allem Zweifel zum Trotz eines voller Hoffnung ist. \"Zwei Brüder\" ist ein Film für Jung und Alt, der zum Staunen und Mitbangen einlädt und darüber hinaus versucht, beim Zuschauer ein Bewusstsein für die ihn umgebende Natur zu schaffen. Fazit: Ein schöner, ein wichtiger Film.', 105, '5I2pRuJI3SZVsxP5iaorGaczzkI.jpg', NULL, '2004-04-07', 1997),
(82, 'Saw', 'Ohne die leiseste Ahnung, wie sie in diesen Albtraum geraten sind, erwachen zwei Männer angekettet an gegenüberliegenden Wänden in einem Kellerverlies. Hinterlassen hat ihr Entführer lediglich eine ausgeblutete Leiche und ein Tonband, auf dem er den Gefangenen einen Ausweg anbietet. Wenn sie beweisen, dass sie bereit sind, wirklich alles für ihr überleben zu tun, haben sie die Chance, aus ihrem Verlies zu entkommen. Doch die Spielregeln des Sadisten sind gnadenlos. Wer die Freiheit will, muss sich selbst verstümmeln oder zum Mörder werden...', 103, 'mlllmFvodsry9QUIc3fT6Hf4pXd.jpg', NULL, '2004-10-01', 176),
(83, 'Dawn of the Dead', 'Eine mysteriöse Seuche, die die Toten auferstehen lässt, welche dann Jagd auf die Lebenden machen, überrollt die USA. Das System bricht zusammen, so dass die Überlebenden auf Selbsthilfe angewiesen sind. Eine Gruppe Überlebender, darunter die Krankenschwester Anna und der Polizist Kenneth, schließt sich zusammen und sucht Zuflucht in einem Einkaufszentrum, das Unterkunft und Nahrung bietet. Doch das „Rest-Erinnerungsvermögen“ der lebenden Toten führt diese zurück an die Orte ihres Lebens und bald ist auch dieser Ort nicht mehr sicher. Notgedrungen starten die Überlebenden den Versuch, vom Festland auf eine Insel zu flüchten, wozu sie sich den Weg natürlich freikämpfen müssen …', 109, '10I2elhPTKYCiSjaMImQk6p7vv6.jpg', NULL, '2004-03-19', 924),
(84, 'Findet Nemo', 'Im Schutze eines großen Riffs lebt die Familie von Clownsfisch Marlin relativ sicher und trotzdem werden seine Frau und nahezu alle seine Kinder Opfer eines gefräßigen Räubers. Das einzige ihm verbleibende Kind ist der kleine Nemo, der von da an besonders behütet wird. Doch die Neugier ist zu groß und prompt wird Nemo gefangen und zu den Menschen als Zierfisch gebracht. Durch ein paar Möwen erfährt Marlin alsbald, wo Nemo gelandet ist: im Aquarium eines Zahnarztes in Sydney. Mutig macht sich der Clownsfish mit seiner Freundin Dory, die allerdings ständig an Gedächtnisverlust leidet auf den Weg dorthin, wobei an Haien, Quallen und anderen Gefahren. Währenddessen ist Nemo nicht untätig und plant mit den anderen Aquariumsfischen einen gewagten Ausbruch aus ihrem Gefängnis...', 100, 'eTo3OCVgWL6UyZtcPFg604jO3Ep.jpg', NULL, '2003-05-30', 12),
(85, 'Natürlich blond 2', 'Elle ist entsetzt: Die Mama von Brutus, ihrem geliebten Chihuahua, wird in einer Tierversuchsanstalt gefangen gehalten! Da müssen ihre Karriere als Anwältin und ihre Hochzeitspläne erst einmal warten. Wird sie es schaffen, Brutus Mom zu retten, dem hässlichen Gesicht der Politik eine Schönheitskur zu verpassen - und obendrein pünktlich vorm Altar zu erscheinen?', 95, 'kaMg08a6p8Icrw7gMDoEFBMrWOw.jpg', NULL, '2003-07-02', 10327),
(86, 'Agent Cody Banks', 'In seinem Sommerferienlager ist der 15-jährige Cody Banks von der CIA rekrutiert und zum Nachwuchsagenten ausgebildet worden. Während seine Eltern und Freunde davon nicht den blassesten Schimmer haben, erhält der unauffällige Cody seinen ersten Auftrag. Er soll die hübsche Tochter eines Wissenschaftlers und diesen selbst ausspionieren, um zu verhindern, dass dessen neueste, menschheitsbedrohende Entdeckung in die Hände eines skrupellosen Gangsters gerät. Leider ist Cody aber in Bezug auf Mädchen eine totale Niete.', 102, '9ojS8KLeGtvTz3yJY3Nv1F1esnB.jpg', NULL, '2003-03-14', 10923),
(87, 'Der Herr der Ringe - Die Rückkehr des Königs', 'Saurons Heer will Minas Tirith angreifen, die in Felsen errichtete Hauptstadt von Gondor. Angesichts der Bedrohlichkeit des feindlichen Heeres wiegt es umso schwerer, dass Gondors König fehlt und nur der schwächliche Truchsess Denethor über das einst mächtige Königreich wacht. Wird Aragorn die Kraft aufbringen, jene Aufgabe zu übernehmen, für die sein Schicksal ihn bestimmt hat? Während Gandalf verzweifelt versucht, die mutlosen Kämpfer von Gondor zu motivieren, sammelt Théoden die Krieger von Rohan, um am Kampf teilzunehmen. Aber obwohl sie tapfer und leidenschaftlich Widerstand leisten, haben die Streitkräfte der Menschen dem überwältigenden Ansturm der feindlichen Legionen gegen das Königreich kaum etwas entgegenzusetzen. Jeder Sieg fordert große Opfer. Trotz der starken Verluste stellen sich die Gefährten der größten Schlacht ihres Lebens - vereint durch ein einziges Ziel: Sauron muss so lange abgelenkt werden, bis Frodo den Ring vernichtet hat...', 201, 'uFjlP9U9UOZAzGB25HUtmlEpXbc.jpg', NULL, '2003-12-01', 122),
(88, 'Tränen der Sonne', 'Ein Routineauftrag wird für A. K. Waters, Lieutenant einer acht Mann starken Navy-Spezialeinheit, zur Gewissensprobe: aus einem Krisengebiet in Afrika soll die Amerikanerin Dr. Kendricks gerettet werden, die mitten im Dschungel ein Missionskrankenhaus leitet, während das Land um sie herum vom Bürgerkrieg zerrüttet wird. Alles verläuft nach Plan, bis sich Kendricks weigert, die Menschen zurückzulassen, die in der Mission auf Schutz und Hilfe gehofft hatten, und Waters und seine Männer Zeuge werden, wie brutal die Rebellen gegen die Bevölkerung vorgehen. Entgegen den strikten Anweisungen seines Captains Bill Rhodes entscheidet Waters schließlich, sein eigenes Leben und das der Truppe zu riskieren, um die Dorfbewohner auf einem gefährlichen Marsch durch den Dschungel zur nahen Grenze zu leiten.', 121, '7rnxFaty1Tb6Xlds1KhWsO8WVpE.jpg', NULL, '2003-03-07', 9567),
(89, 'The Time Machine', 'Der Wissenschaftler und Erfinder Alexander Hartdegen will beweisen, dass Zeitreisen möglich sind. Ein persönlicher Schicksalsschlag verwandelt seinen Ehrgeiz in schiere Verzweiflung: Sie treibt ihn umso unerbittlicher an, seine Erfindung zu vollenden und in die Vergangenheit zu reisen, um dort dem Lauf der Dinge eine neue Wendung zu geben. Als er die von ihm konstruierte Zeitmaschine ausprobiert, wird Hartdegen 800.000 Jahre in die Zukunft katapultiert. Dort muss er entdecken, dass die Menschheit in zwei Lager gespalten ist: die Jäger und die Gejagten.', 96, 'jS2DNBwVetQ2JzkcsI3fHXgTHGT.jpg', NULL, '2002-03-04', 2135),
(90, 'Stuart Little 2', 'Der Mäuserich Stuart lebt immer noch glücklich bei der Familie Little. Neben der neun Monate alten Martha hat die Familie noch weiteren Zuwachs bekommen, nämlich die Vogeldame Margalo, die Stuart aus den Klauen eines Falken gerettet hat. Eines Tages aber verschwindet Margalo auf mysteriöse Weise, woraufhin der Nager sich auf die Suche nach ihr macht. Dabei muß er sich abenteuerlichen Herausforderungen stellen und lernt, wie wichtig Familie, Freundschaft und Vertrauen sind.', 77, 'hjfeMLWqJY44mqqJKZSa6jx4Y1j.jpg', NULL, '2002-07-19', 10996),
(91, 'Der Herr der Ringe - Die zwei Türme', 'Der Weg der Gefährten hat sich geteilt. Ringträger Frodo und sein treuer Begleiter Sam treffen in den Bergen von Emyn Muil auf Gollum, dem einst Bilbo Beutlin den Einen Ring wegnahm. Gollums Versuch, den mächtigen Ring von Frodo zu stehlen, misslingt, doch die Hobbits bringen es nicht übers Herz, die Kreatur zu töten. Stattdessen soll Gollum die beiden nach Mordor an die Pforten von Barad-Dûr, Saurons Festung, führen, wo Frodo den Ring vernichten will. Währenddessen folgen Aragorn, Elben-Bogenschütze Legolas und Zwerg Gimli den Spuren der von Orks verschleppten Hobbits. Im Menschenkönigreich Rohan ersuchen sie Unterstützung. Doch König Theoden steht unter einem tödlichen Bann Saurons. Erst als Gandalf als wiedergeborener weißer Zauberer zurückkehrt, wendet sich das Blatt. Er befreit Theoden von dem Fluch und bringt die Menschen von Rohan hinter sich. Unterdessen rückt Saurons Verbündeter Saruman mit einer 10.000 Mann starken Armee von Uruk-hais in RIchtung der Menschenstadt vor...', 179, 'tgBCeAjPwXeUaf8LsRL0LzBIcdR.jpg', NULL, '2002-12-18', 121),
(92, 'Monte Cristo', 'Um sich an die schöne Verlobte seines besten Freundes heranmachen zu können, denunziert Fernand Mondego den naiven Seemann Edmond Dantes wegen Verrats bei der Obrigkeit. Dieser wird für sein angebliches Verbrechen lebenslänglich in das Château D\'If verbannt. Dort lehrt ihm der Abbé Faria Lesen, Schreiben, Manieren und Fechten und verrät ihm sogar das Versteck eines riesigen Vermögens. Als Dantes nach 13 Jahren die Flucht gelingt und er den Schatz geborgen hat, kehrt er als Graf von Monte Cristo in die Gesellschaft zurück...', 131, 'bI6JtSf9wNWzVGWeEskDFf6HpE1.jpg', NULL, '2002-01-23', 11362),
(93, 'Wir waren Helden', 'Der altgediente Lt. Colonel Hal Moore soll ein 400-Mann starkes Platoon in die erste Schlacht des Vietnamkrieges führen. An einem idyllischen Sommertag landet das Platoon in Vietnam, in einem Gebiet mit dem Codenamen \'X-Ray\'. Dieses malerische Tal, umgeben von einer grünen wunderschönen Hügellandschaft sollte jedoch schon bald seinem heutigen Spitznamen \"Das Tal des Todes\" gerecht werden, denn auch wenn bei ihrer Landung überraschenderweise alles ruhig war, so sollte sich doch der Anfang einer der blutigsten Schlachten des Krieges mit großen Schritten nähern. Moore führt ohne eine Wahl zu haben die teils unerfahrenen und jungen Söhne von Vätern, Väter von Söhnen und Brüder von Schwestern in eine scheinbar bereits verlorene Schlacht.', 138, '30VD0fusyWEU8a931SDtyVGb3fO.jpg', NULL, '2002-03-01', 10590),
(94, 'The Hole', 'Vier Teenager lassen sich gemeinsam in einem verlassenen Bunker einsperren. Drei Tage lang wollen sie in dieser gruseligen Atmosphäre campieren und ein wenig feiern. Erst 18 Tage später gelingt es einem der vier als einziger Überlebender aus dem Loch zu fliehen. Welch grausame Dinge sich in den vergangen Wochen dort unten abgespielt haben gilt es nun herauszufinden.', 98, 'zVDhZHjcE0ksNfFSsJVoxDdAYCJ.jpg', NULL, '2001-04-20', 467),
(95, 'Ali', 'Dem weltberühmten Boxer Cassius Clay gelingt es, Sonny Liston 1964 den Schwergewichtstitel abzunehmen. Der Champ konvertiert bald darauf zum Islam, erhält den Namen Muhammad Ali und heiratet die frei denkende Sonji. Die Ehe scheitert, und 1967 verweigert Ali den Kriegsdienst in Vietnam. Er wird daraufhin angeklagt und bekommt seine Boxlizenz entzogen. Auch als Weltmeister wird er nicht mehr anerkannt. Drei Jahre kämpft er gegen eine mögliche Haftstrafe, bis er begnadigt wird. Inzwischen ist Joe Frazier Weltmeister und auch Ali verliert sein WM-Comeback nach Punkten. Dreieinhalb Jahre später, 1974, fordert er den neuen Weltmeister George Foreman in Zaire zum Comeback-Fight heraus, zum \"Rumble in the Jungle\"...', 159, 'egElkVIfy5zMrl8Kqt9DP6NLQbA.jpg', NULL, '2001-12-11', 8489),
(96, 'Planet der Affen', '2029: Astronaut Leo Davidson befindet sich auf einer Routine-Mission durchs Weltall. Plötzlich gerät er in ein Wurmloch und fliegt durch Zeit und Raum. Er landet auf einem Planeten, auf dem sprechende Affen über die Menschen herrschen! Mit Hilfe der sympathischen Schimpansin Ari und einer kleinen Gruppe menschlicher Rebellen widersetzt sich Leo der Gorilla-Armee, welche von General Thade und seinem besten besten Krieger Attar angeführt wird. Nun versuchen sie, einen heiligen Tempel in der Verbotenen Zone zu erreichen, der die schockierenden Geheimnisse der untergegangenen Menschheit enthält - und den Schlüssel für ihre Zukunft...', 119, '9ZgnkRKl2iwzoDlQPUb08Fm9EZh.jpg', NULL, '2001-07-25', 869),
(97, 'Der Herr der Ringe - Die Gefährten', 'Dem Hobbit Bilbo Beutlin fällt zufällig ein machtvoller Ring in die kleinen Hände. Dieses Schmuckstück erlaubte es dem finsteren Herrscher Sauron einst, die Welt zu unterjochen. Der Ring schien über Jahrhunderte verloren, bis Bilbo ihn an sich nahm und seinen \"Schatz\" sechzig Jahre lang bewahrte. An seinem 111. Geburtstag gibt er ihn schweren Herzens an seinen Neffen Frodo weiter und verlässt seine Heimat Mittelerde. Für den jungen Hobbit Frodo wird der Ring jedoch zur schweren Bürde. Der böse Geist Saurons, der in dem \"Einen\" gefangen ist, wird immer stärker. Frodo bleibt nur eine Möglichkeit: Er muss ihn vernichten. Allerdings ist das nicht gerade einfach. Nur in den ewigen Feuern des Schicksalsberges im Lande Mordor, wo der Ring geschmiedet wurde, kann er auch vernichtet werden. Doch bis dahin muss Frodo an der Seite des Zauberers Gandalf und seiner Gefährten durch Feindesland ziehen, immer verfolgt von Saurons Lakaien...', 178, 'k6lw7hhaMDzJ170bfZfBbnipxcW.jpg', NULL, '2001-12-18', 120),
(98, 'Jason X', 'Irgendwo in der unterirdischen „Crystal Lake Research Facility“, irgendwann zu Beginn des 21. Jahrhunderts: Trotz der Bedenken Rowans, einer jungen Projektleiterin, soll das Forschungsobjekt „Jason Voorhees“ von einem kleinen Militärtrupp in ein anderes Labor verlegt werden. Jason befreit sich aus seinen Ketten, macht mit den erfahrenen Soldaten kurzen Prozess und wird anschließend von Rowan in eine Cryo-Kammer gelockt. Dort gelingt es ihr zwar, das Monster einzufrieren, sie selbst entkommt dem lähmenden Eis allerdings genauso wenig. Im Jahr 2455 landet ein Forschungsschiff auf der inzwischen zerstörten Erde, sichert die beiden Funde und macht sich wieder auf den Weg nach „Erde 2“, wo die Menschheit eine neue Heimat fand. Rowan kann reanimiert werden, was bei Jason selbstredend automatisch geschieht. Einmal wach, begibt sich der Killer auf eine blutige Jagd nach den an Bord befindlichen Teenagern.', 91, 'mazTT6xgHxogCjotbIhxOSIr3bq.jpg', NULL, '2001-07-24', 11470),
(99, 'Final Destination', 'Auf dem Weg zum Schüleraustausch nach Europa hat Alex Browning im wartenden Flugzeug plötzlich eine Vision, dass der Flieger abstürzen wird. Er bekommt einen hysterischen Anfall, woraufhin er des Flugzeugs verwiesen wird. Einige seiner Freunde und eine Lehrerin folgen. Tatsächlich explodiert die Maschine nach dem Start und macht Alex plötzlich zum Hauptverdächtigen. Viel schlimmer ist allerdings der Nebeneffekt, dass sein schicksalswidriges Verhalten den Tod offensichtlich nötigt, nachzuarbeiten, so dass die Überlebenden einer nach dem anderen eines plötzlichen Todes sterben. Alex ahnt den Plan, der dahinter steckt und macht sich so noch verdächtiger, entwickelt aber schnell einen Plan, den Tod auch bei der nächsten Runde auszutricksen ...', 98, '418vOdcfd268Fs0Zk9Jdaokn8l2.jpg', NULL, '2000-03-17', 9532),
(100, 'Dinosaurier', '65 Millionen Jahre vor unserer Zeit und weit weg von seiner Heimat wird das Dinosaurier-Baby Aladar von einer Lemurenfamilie aufgezogen. Doch der riesige Spaß mit seinen kleinen Freunden Zini und Plio hat ein jähes Ende, als ein Meteoriteneinschlag sie zur Flucht zwingt. Aladar und seine Familie schließen sich einer Herde Dinosaurier an, die sich auf dem gefahrvollen Weg in eine neue Heimat befindet. Eine abenteuerliche Expedition voller Mut, Freundschaft und Hoffnung beginnt ...', 82, 'ewZyWbih35bgnGTLaFUc6d8PLEw.jpg', NULL, '2000-05-19', 10567),
(101, 'Gladiator', 'Der gefeierte römische Feldherr Maximus wird vom sterbenden Kaiser Marcus Aurelius gebeten, seine Nachfolge anzutreten. Um dies zu verhindern, tötet Aurelius Sohn seinen Vater und ordnet die Exekution von Maximus und seiner Familie an. Maximus gelingt die Flucht, verwundet wird er von einem Sklavenhändler gefangen genommen und muss sich fortan als Gladiator beweisen. Als Kampfmaschine hat er schließlich nur noch ein Ziel: Rache an seinem Peiniger zu nehmen …', 154, '103TWtxYiPkVWiULjh1mo6x3VjZ.jpg', NULL, '2000-05-01', 98),
(102, 'Family Man', 'Wall-Street-Playboy Jack Campbell steht auf dem Gipfel seines Erfolges. Dies ändert sich schlagartig, als er am Weihnachtsabend einen Überfall vereitelt. Denn zur \"Belohnung\" erwacht er am Morgen danach in einem anderen Leben - exakt dem Leben, das er geführt hätte, wäre ihm nicht seine Karriere wichtiger gewesen: Als Familienvater an der Seite seiner College-Liebe in New Jersey. Nachdem der erste Schock überwunden ist, beginnt Jack, sich allmählich wohl zu fühlen. Bis ihm das Schicksal erneut eine brillante Karriere verspricht...', 125, '4LWTC1BleNEwNaDd76oUu7VXPoC.jpg', NULL, '2000-12-12', 5994),
(103, 'Die Legende von Bagger Vance', 'Der Spitzen-Golfer Rannulph Junuh aus Savannah, Georgia, wird durch einen Fronteinsatz im Ersten Weltkrieg aus der Bahn geworfen. Wieder zu Hause, kehrt er sowohl Gesellschaft als auch Verlobter den Rücken, bis seine einstige große Liebe 1931 ein Golfturnier organisiert. Neben zwei Profi-Golfern soll auch ein Lokalmatador antreten: Rannulph. Doch der hat seinen \"authentischen Schwung\" verloren. Da erscheint der charismatische Bagger Vance, der ihm als Caddie beistehen und durch Golf- sowie Charaktertraining den rechten Weg weisen will.', 128, '7jKjh9PZvHJYYtCycQmTbBoZVV4.jpg', NULL, '2000-11-02', 4958),
(104, 'Stuart Little', 'Familie Little bekommt Zuwachs. Eigentlich wollten Mama und Papa ihrem Sohnemann im Waisenhaus ja ein Brüderchen besorgen, aber dann haben sie sich doch für Stuart, eine kleine Maus, entschieden, die schon sehr lange im Waisenhaus ist. Doch der kleine Neuling in der Familie wird nur von den beiden Erwachsenen akzeptiert, Sohn und Katze haben ihre Probleme mit der Gleichstellung eines sprechenden Nagetiers.', 84, '4K4zPskjMo57crCPAPkREP0gyrQ.jpg', NULL, '1999-12-17', 10137),
(105, '8MM - Acht Millimeter', 'Tom Welles ist ein prüder Überwachungsspezialist, dessen naive und unschuldige Weltsicht nachhaltig erschüttert wird, als die Witwe eines Industriellen ihn engagiert, um den Inhalt des Safes ihres verstorbenen Mannes zu untersuchen. Dabei handelt es sich nämlich offenbar um einen Snuff-Film von der Ermordung eines jungen Mädchens. Um die Wahrheit aufzudecken, muss Welles unter der Führung des Pornoladen-Angestellten Max California in die zwielichtige Unterwelt der Stadt eintauchen...', 123, 'pcIi8XH8ToODyzDKRn7bJZX9Jf2.jpg', NULL, '1999-02-26', 8224),
(106, 'Psycho', 'Auf der Flucht vor dem Arm des Gesetzes sucht Marion CraneUnterschlupf in einem Motel, das von einem gewissen Norman Bates geleitet wird. Bates’ Gäste erwartet ein schreckliches Schicksal in Person seiner Mutter. Marion wird ihr nächstes Opfer, und ihr Verschwinden ruft ihre Schwester sowie einen Privatdetektiv auf den Plan. Die beiden stoßen bald auf die morbide Verbindung zwischen Norman und seiner geheimnisvollen Mutter.', 109, 'ymealVPnlVEmm7eAGqcy7vCKoxB.jpg', NULL, '1998-12-04', 11252),
(107, 'Der Staatsfeind Nr. 1', 'Der bedingungslose Schutz der US-Demokratie - so lautet der Auftrag des mächtigen amerikanischen Geheimdienstes NSA. Thomas Brian Reynolds, ein Mitglied der NSA, sieht die Realisierung dieses Auftrages gefährdet. Denn ein Politiker bringt die Verabschiedung eines Gesetzes in Gefahr, das dem Geheimdienst uneingeschränkte Freiheit bei Lauschangriffen und Abhöraktionen einräumen soll. Eiskalt läßt er den Widersacher aus dem Weg räumen. Doch der Mord wird zufällig gefilmt. Ein Beweismittel, das dem jungen Staranwalt Robert Dean unbemerkt zugesteckt wird. Ohne die genauen Hintergründe zu kennen, gerät Dean ins Visier der NSA und verliert alles: seinen Job, seine Frau, seinen Ruf, seine Identität...Doch auf der Flucht vor den unbekannten Gegnern bekommt Dean Hilfe. Der im Untergrund arbeitende Überwachungsexperte Brill macht ihm klar, wer so skrupellos Jagd auf ihn macht.', 132, 'uKXjrjjYc5Ro2cr75MTK1Yp8MW9.jpg', NULL, '1998-11-20', 9798),
(108, 'Mulan', 'Dieses alte chinesische Märchen erzählt die Geschichte des jungen Mädchens Mulan, dessen alter, kranker Vater in die Armee eingezogen wird, um die einfallenden Mongolen zu bekämpfen. Da er in seinem Zustand die Strapazen des Krieges nicht überleben würde, verkleidet sie sich als Mann und gibt sich als ihr Vater aus. Ihre Vorfahren sind mit diesem Plan nicht einverstanden und schicken deshalb den kleinen Drachen Mushu hinterher, um sie von ihrem Vorhaben abzubringen. Doch als er Mulan begegnet, schlägt er sich auf ihre Seite…', 88, 'rZAkB9ayPVgHu2Q9dVgNz2QaI5p.jpg', NULL, '1998-06-18', 10674),
(109, 'Die Maske des Zorro', 'Don Diego De La Vega ist Zorro. Sein Markenzeichen, das “Z” lässt die Mächtigen erzittern und die Unterdrückten hoffen. Nach 20 Jahren Gefangenschaft im Verlies von Gouverneur Don Rafael Montero gelingt Zorro endlich die Flucht. Beseelt von dem Gedanken an Rache für seine ermordete Frau und die entführte Tochter Elena will er Montero töten – und findet in dem ungeschliffenen Banditen Alejandro Murrieta einen idealen Nachfolger. Er trainiert den jungen Wilden, lehrt ihn den Umgang mit Degen und Peitsche. Dieser wird seine neue Waffe gegen Montero sein! Doch der Weg zur entscheidenden Schlacht ist steinig und Monteros Handlanger sind unerbittlich. Es ist ein gewaltiger Kampf für Freiheit und Gerechtigkeit, aber auch ein Kampf um Elena, den vier Männer gleichermaßen leidenschaftlich fechten.', 136, 'i2r1Z1grQipfvDMHXDdafe23eKl.jpg', NULL, '1998-07-16', 9342),
(110, 'Der Mann in der eisernen Maske', 'Frankreich im 17. Jahrhundert: Während Ludwig XIV. rauschende Feste feiert, lebt das Volk in Hunger und Elend. Der Sonnenkönig hat ein furchtbares Geheimnis: In einem finsteren Verlies hält er seinen Zwillingsbruder gefangen – das Gesicht hinter einer eisernen Maske verborgen! Als das Land in Unruhen und Rebellion zu versinken droht, fassen die Musketiere Athos, Porthos und Aramis einen Plan zum Sturz des Tyrannen. Einzig d’Artagnan, der dem Sonnenkönig weiterhin treu ergeben ist, könnte ihr Vorhaben noch gefährden.', 132, '9pOxLbrR1tU1yrtRgPkuZ7qjyUC.jpg', NULL, '1998-03-12', 9313),
(111, 'Der Schakal', 'Niemand kennt seine Identität, sein Ziel, seinen Zeitplan. Für ein Kopfgeld von 70 Millionen Dollar angeheuert, soll der Schakal eine der prominentesten Polit-Persönlichkeiten der Welt öffentlich töten. FBI und KGB setzen alles daran, das Attentat zu verhindern. Ihre Chancen dürftig. Der Killer ist zu schnell, zu wandlungsfähig, zu kaltblütig. Wo immer die Geheimdienste hinkommen, finden sie nur blutige Spuren. Ihre einzige Hoffnung ist jemand, der Gewalt aus erster Hand kennt und den Schakal womöglich identifizieren kann. Jemand wie der zu lebenslanger Haft verurteilte Ex-Terrorist Declan Mulqueen. Er gibt sein Wort, nicht zu flüchten. Wird er das Versprechen halten? Die Uhr tickt unerbittlich ...', 124, '1K9pnJkKbSQyBYD1zr0wL3Y0k0T.jpg', NULL, '1997-11-14', 4824),
(112, 'Volcano - Heisser als die Hölle', 'Dass in Los Angeles die Erde manchmal etwas bebt, ist man ja dort schon gewohnt. Aber was den Bewohnern nun bevorsteht, damit hätte wirklich niemand gerechnet. Unter den Straßen der Stadt brodelt ein gewaltiger Vulkan, dessen Ausbruch nicht zu verhindern ist. Und erst wie sich die glühende Lava ihren Weg durch die Straßen bahnt, nimmt man den scheinbar aussichtslosen Kampf gegen die mächtige Naturgewalt auf...', 104, '5xIjktjXuro7anZ6AR58t5ZYWjQ.jpg', NULL, '1997-04-25', 10357),
(113, 'Im Körper des Feindes', 'Zehn lange Jahre folgte FBI-Agent Archer der Blutspur des Superverbrechers Castor Troy. Doch jetzt, wo dieser halbtot geschossen vor ihm liegt, kann er sich nicht darüber freuen. Denn leider hatte Troy zuvor noch Zeit, eine verheerende Bombe irgendwo in L.A. zu deponieren. Archer bleibt nur eine Möglichkeit - er muß die Identität des verhaßten Widerparts annehmen, um an das Versteck der Bombe zu kommen. Ein revolutionärer Fortschritt in der kosmetischen Chirurgie macht\'s möglich - leider nicht nur in eine Richtung.', 138, '2I9sQdeIfkxUpzikVIVRbUyh3Nm.jpg', 'https://www.youtube.com/embed/CxrTRZKCbM0', '1997-06-27', 754),
(114, 'Postman', 'Nach einem verheerenden Atom-Krieg im Jahr 2013 ist die Welt in totaler Gesetzlosigkeit versunken. Die Überlebenden werden von dem tyrannischen General Bethlehem unterdrückt. Eines Tages erscheint ein geheimnisvoller Fremder. Er gibt den Menschen ihre Hoffnung und ihren Willen zum Widerstand zurück. Doch der Aufstand, den er entfesselt, entgleitet seiner Kontrolle ...', 177, '4MAJofIafPBC5zC0p8O8pfnrJeE.jpg', NULL, '1997-12-25', 9922),
(115, 'The Game - Das Geschenk seines Lebens', 'Nicholas Van Orton ist reich, intelligent und erfolgreich. Ein knallharter Geschäftsmann mit Prinzipien und Selbstdisziplin. Er hat die absolute Kontrolle über sein Leben und seine Geschäfte - bis ihm sein Bruder Conrad zu seinem 48.Geburtstag die Eintrittskarte für ein geheimnisvolles Spiel schenkt. Ein Spiel ohne Spielregeln, aber mit höchstem Einsatz. Nur zögernd lässt Van Orten sich auf \"The Game\" ein - und erlebt den Alptraum seines Lebens: Erst verliert er die Kontrolle, dann seinen Besitz und schließlich geht es nur noch um\'s nackte Überleben...', 129, 'bnxXqCAinEI0WQtHId2SeyEMBye.jpg', NULL, '1997-09-12', 2649),
(116, 'Crash', 'Der monotone Alltag des Filmproduzenten James Ballard und seiner Frau Catherine hat nur wenig Abwechslung in einer grauen, anonymen Großstadt.  Ein Autounfall ändert alles. Quietschende Reifen, zersplittertes Glas und der Knall des Metalls bringen in Ballards Leben neue intensive Gefühle.  Das kühle Metall und die Kraft der Maschine werden zur sinnlichen Erfahrung, das Auto wird zur erotischen Leidenschaft. Auch die Fahrerin des anderen Autos, Dr. Helen Remington, spürt seit ihrer Karambolage das selbe...', 100, '5lDENqycd6WMXMPtD9GxWfYh4bq.jpg', NULL, '1996-07-17', 884),
(117, 'Der Glöckner von Notre Dame', 'Aus seinem Glockenturm hoch über den Dächern von Paris verfolgt der Glöckner Quasimodo sehnsüchtig das Fest der Narren – die fröhlichste Party des Jahres. Obwohl es ihm verboten wurde, ermutigen ihn seine urkomischen Freunde, an dem Fest teilzunehmen. So wagt sich Quasimodo in das Getümmel und erlebt eine Welt, von der er bislang ausgeschlossen war. Nur die schöne, temperamentvolle Esmeralda begegnet ihm mit Toleranz und Freundschaft. Als er sie vor Verfolgern schützt, gerät Quasimodo in ein ergreifendes Abenteuer voller Action, Spaß und Überraschungen, die ihn schließlich zum Helden von Paris werden lassen.', 91, 'fb3pLwahhsvJNJtnql6hmcV4GU9.jpg', NULL, '1996-06-21', 10545),
(118, 'Operation: Broken Arrow', 'Vic Deakins und Riley Halemachen mit einem B-3-Stealth-Bomber, der zwei Atombomben an Bord hat, einen Übungsflug. Doch Deakins spielt mit falschen Karten. Er bringt die Waffen in seine Gewalt und erpresst die Regierung mit der Drohung, Millionen Menschenleben mittels eines nuklearen Supergaus zu vernichten. Aus den Freunden sind Feinde geworden. Zu Wasser, zu Lande, in der Luft, in Flugzeugen und auf einer dahinrasenden Eisenbahn kommt es zu einem gnadenlosen Gefecht...', 108, 'd9cO2RBwhoZWXSXxhHfbDh1xR0p.jpg', NULL, '1996-02-09', 9208),
(119, 'Clueless - Was sonst!', 'Es ist nicht leicht das beliebteste und bestangezogendste Mädchen der Beverly Hills High School zu sein. Vor allem, wenn man dazu noch den Neid zahlreicher Möchtegern- Schönheiten auf sich zieht. Für Cher ist das alles kein Problem. Sie findet sogar noch etwas Zeit für ihre Hobbies: Zum Beispiel für ihre Lehrerin einen Liebhaber zu finden, oder ein schüchternes Mauerblümchen in ein Objekt männlicher Begierde zu verwandeln. Erst als Justin, ein verdammt gutaussehender Junge, und ihr Ex-Stiefbruder Josh unerwartet auf der Bildfläche erscheinen, gerät auch Chers Gefühlsleben beträchtlich durcheinander', 93, '71RW4lkES2Dt7vSLSXvekGYNskG.jpg', NULL, '1995-07-19', 9603),
(120, 'Ein Schweinchen namens Babe', 'Das verwaiste Schweinchen Babe kommt auf den Hof des Bauerns Arthur Hoggett. Dort wird sie von den anderen Tieren aufgenommen. Die neue Ziehmutter Fly, ein Border-Collie, bringt Babe das Handwerk des Schafehütens bei. Babe wird so gut, dass Arthur sie an einem Schafshunde-Wettbewerb anmeldet.', 89, 'rTtW6Q9Jaei8AjzAMv9xSgKnc9N.jpg', NULL, '1995-07-18', 9598),
(121, 'Stirb langsam - Jetzt erst recht', 'John McClane ist es gewohnt, dass ihm das Schicksal übel mitspielt, doch nun ist er wirklich am Ende: Seine Frau hat ihn verlassen, sein Boss hat ihn suspendiert und ein Irrer namens Simon macht sich einen Spaß daraus, ihn auf eine makabere Schnitzeljagd quer durch New York zu schicken. Der Terrorist droht damit, eine Schule in die Luft zu jagen, sollte McClane seine Rätsel nicht lösen könne. Seine erste Aufgabe führt ihn ins Ghetto von Harlem, wo er sich mit einem Schild mit der Aufschrift \"I hate niggers\" präsentieren soll. Bei den Anwohnern erntet er damit erwartungsgemäß keinen Beifall, sondern gerät postwendend in Bedrängnis. Der schwarze Ladenbesitzer Zeus kommt dem Polizisten zur Hilfe und wird McClane kurzerhand als unfreiwilliger Helfer zur Seite gestellt. Simon hat seine helle Freude daran, die Partner wider Willen durch die Stadt zu hetzen und ihnen unmögliche Aufgaben zu stellen...', 131, 'iKbeYMYjYy4dR3nAkCFuEKhgV6m.jpg', NULL, '1995-05-19', 1572),
(122, 'Dracula - Tot aber glücklich', 'Nachdem Graf Dracula in dem Engländer Renfield einen neuen Assistenten gefunden hat, verlässt er im Jahre 1893 Transsylvanien und reist nach London. Während Renfield kurz darauf in die Nervenklinik von Dr. Seward landet, versucht Dracula, seinen Durst bei Sewards Tochter Mina und deren Freundin Lucy zu stillen. Doch der Blutsauger hat nicht mit der Hartnäckigkeit des ausgewiesenen Vampirjägers Van Helsing gerechnet. Der gewiefte Professor versteht es, Dracula einen äußerst fatalen Stolperstein zu stellen...', 88, 'c851gI2MiAdnJErelohgWkQQKaz.jpg', NULL, '1995-12-22', 12110),
(123, 'Der König der Löwen', 'Unter der Obhut seines Vaters Mufasa wächst der Löwenjunge Simba unbeschwert heran und soll eines Tages dessen Platz als König einnehmen. Aber bis dahin ist es ein langer Weg, der Simbas ganzen Mut erfordert. Stets begleitet von seinen witzigen Freunden Timon und Pumbaa und deren urgemütlicher Lebensphilosophie “Hakuna Matata”, muss Simba sich seiner größten Herausforderung stellen: dem Kampf mit dem hinterhältigen Scar um die Herschaft über das “geweihte Land” ...', 89, 'sb2y6mpYXIBzucXldDxMCNHn0vi.jpg', NULL, '1994-06-23', 8587),
(124, 'Enthüllung', 'Seine Karriere, seine Ehe, seine Zukunft - für Tom Sanders, Manager von DigiCom, steht alles auf dem Spiel. Nachdem er die leidenschaftlichen Avancen seiner neuen Vorgesetzten abgewiesen hat, wirft sie ihm sexuelle Belästigung vor. Plötzlich beginnt für Tom ein verzweifelter Kampf um seine berufliche Existenz. Bei seinen Nachforschungen in den geschäftlichen Aktivitäten der Firma stößt er auf eine groß angelegte Verschwörung in den höchsten Etagen des Konzerns. Der umstrittene Skandalfilm, der Amerika an einem besonders wunden Punkt getroffen hat, nach dem Bestseller von Michael Crichton.', 123, 'wFbadUq9jBMPGvpcgeqVgncvamM.jpg', NULL, '1994-03-10', 8984),
(125, 'Freddy\'s New Nightmare', 'Heather Langenkamp, die Hauptdarstellerin des ersten Nightmare-Films ist inzwischen glücklich verheiratet und hat einen kleinen Sohn, Dylan. Da bereitet Regisseur Wes Craven einen neuen Nightmare-Film vor und Heather soll wieder die Nancy spielen. Gleichzeitig fängt ein Unbekannter an, sie per Telefon zu terrorisieren und ihr Sohn zeigt plötzlich beunruhigende Veränderungen. Robert Englund, der den Freddy spielt, ist völlig überrascht, mit diesen Vorgängen in Verbindung gebracht zu werden. Als Craven selbst Alpträume bekommt und die erste Morde geschehen, weiß Heather, dass es Freddy in die Realität geschafft hat...', 112, 'e9gMrCkJyIudijMpDT8inr7WrQK.jpg', NULL, '1994-10-13', 11596),
(126, 'Zeit der Unschuld', 'Newland Archer gehört zur Upper Class des New York von 1870. Seine Verlobung mit der bezaubernden May Welland steht bevor, da tritt Mays Cousine Ellen Olenska in sein Leben. Sie wird von der Gesellschaft wegen ihres fortschrittlichen Denkens und ihrer Vergangenheit abgelehnt. Obwohl Newland seine Hochzeit vorantreibt, verfällt er der schönen Ellen. Doch als sie sich ihre Liebe eingestehen, ist es schon zu spät. Newland gelingt es nicht, aus dem engen Korsett der Konventionen auszubrechen.', 139, 'oCd4R3jAcrp7gN6gn8FuYkG2guA.jpg', NULL, '1993-09-17', 10436),
(127, 'Jason Goes to Hell - Die Endabrechnung', 'Das FBI nimmt sich des wiederkehrenden Serienmörders Jason Voorhees an. Ihr Plan: Er soll in 1000 Teile zersprengt werden. Gesagt, getan, doch irgendetwas scheint nicht ganz funktioniert zu haben, wie Kopfgeldjäger Creighton Duke bemerkt. Sein Verdacht bestätigt sich, als bei der Obduktion von Jasons Überresten nur noch tote Ärzte aufgefunden werden. Creighton geht davon aus, dass sich Jason nun in andere hineinversetzen kann, indem er als Wurm in die Körper seiner Opfer eindringt. Seinen eigenen Körper kann er jedoch nur wieder bekommen, wenn er einen Verwandten findet. Ebenso kann nur ein Verwandter Jason endgültig den Garaus machen. Die einzig lebende Verwandte ist Jessica Kimble, die Tochter von Jasons Schwester. Doch bis sie ihn findet, wird Jason eine blutige Spur hinterlassen.', 87, '344brzPDjw8ZmHzK6kVZl2XGjE4.jpg', NULL, '1993-08-13', 10285),
(128, 'Die Hand an der Wiege', 'Die schwangere Claire zeigt ihren Frauenarzt an, der sie bei einer Untersuchung unsittlich berührt. Als der sich aus Angst vor der Schande das Leben nimmt, kommt es zur Fehlgeburt bei seiner ebenfalls schwangeren Witwe Peyton. Die schwer traumatisierte Peyton schwört Rache und nimmt eine Stelle bei Claires Familie als Kindermädchen. Mit Tricks, Intrigen, Drohungen und schließlich Mord versucht sie Schritt für Schritt Claire zunächst das Baby und schließlich auch ihren Mann Michael abspenstig zu machen. Als Michael sich jedoch auf die Seite seiner Frau stellt, beginnt ein mörderischer Zweikampf. Dem geistig behinderten Gärtner Solomon ist es zu verdanken, daß Peyton gestoppt wird.', 110, 'd9WSkVDO3G9RrsxfIVDkSzGAQpP.jpg', NULL, '1992-01-10', 11087),
(129, 'Die Addams Family', 'Die Kinderchen spielen vegnügt mit Fallbeil, elektrischem Stuhl und Armbrust. Mama Morticia läßt sich zur Feier des Tages ein wenig foltern. Und Papa Gomez macht gerade den Anwalt fertig. Dazwischen krabbelt, wie immer auf flinken Fingern, das Eiskalte Händchen durch die Villa. Normaler, schwarzer Addams-Alltag. Doch nun will sich ein Gauner das Familienvermögen unter den Nagel reißen. Die Addams werden böse wie nie zuvor...', 102, 'fgazIaORmM4uDyysefQlwHqxptp.jpg', NULL, '1991-11-22', 2907),
(130, 'Die Schöne und das Biest', 'Eine Fee verwandelt einen bösen Prinzen in ein “Biest”, und alle Schloßbewohner in diverse Haushaltsgegenstände. Erst wenn sich ein Mädchen in den verzauberten Prinzen verliebt, kann der Fluch gebrochen werden. Als sich dann eines Tages tatsächlich Belle in das Schloß verläuft, tut der Prinz alles andere als liebenswert auf sie zu wirken. Die anderen Schloßbewohner – also die Teekanne, die Uhr und der Kerzenleuchter, versuchen alles, um die beiden zu verkuppeln.', 84, '738LwXpurba93dm0jEDReX98uKm.jpg', NULL, '1991-11-13', 10020),
(131, 'Freddy’s Finale - Nightmare on Elm Street 6', 'Glauben Sie ja nicht, dass Sie jetzt endlich ruhig schlafen können! Denn Freddy Krueger kehrt zurück und verfolgt uns in unseren Träumen, bis das Blut gefriert! Die Kinderpsychologin Lisa Zane wird von ständig wiederkehrenden Albträumen geplagt. Doch erst als sie einen neuen Patienten kennen lernt, findet sie eine Spur, die sie zu einem bestimmten Haus in der Elm Street führt. Dort bereitet sich der Böse, der in keinem Grab Frieden findet, auf einen neuen Großangriff vor.', 89, 't341YdMpdZIkthcMdiAR7gkEvFW.jpg', NULL, '1991-09-05', 11284),
(132, 'Stirb langsam 2', 'Det. Lt. John McClane wartet am Dulles Airport in Washington D.C. auf seine Frau Holly, die mit einem Flieger aus Los Angeles anreist, um mit ihm Weihnachten zu verbringen. Das Wetter ist miserabel: Schneestürme. Aber die meteorologischen Widrigkeiten sind nicht der Grund dafür, dass Hollys Maschine in der Luft bleiben muss. Der südamerikanische Drogen-Boss und Diktator Esperanza soll zur gleichen Zeit an die US-Behörden ausgeliefert werden. Aber Esperanza hat seine Flucht längst penibel vorbereitet. Unter Führung des ehemaligen Colonels Stuart, der inzwischen als Terrorist arbeitet, hat eine Spezialtruppe den Flughafen in ihre Gewalt gebracht. Die Kämpfer kontrollieren auch den Funkverkehr und die Computerzentrale, um Esperanza zur Flucht verhelfen zu können. Einmal mehr muss McClane als Einmann-Spezialeinheit die Lage bereinigen.', 124, 'mdB97eGzcIbQtpxyQuWq25a38v4.jpg', NULL, '1990-07-02', 1573),
(133, 'Flatliners - Heute ist ein schöner Tag zum Sterben', 'Fünf Medizinstudenten wollen die letzte Grenze überschreiten und die Todeserfahrung machen. Nelson ist der Erste. Nach einer Minute wird er von den anderen wiederbelebt. Als er fasziniert von seiner Reise berichtet, reißen sich auch die anderen um den Trip ins Jenseits. Doch Nelson erzählt nicht alles: Seit dem Experiment wird er von einem - ausgesprochen realen - Geist der Vergangenheit verfolgt, dem Jungen Billy, an dessen Tod er die Schuld trug. Während die anderen mit \"ihren\" Geistern im Hier und Jetzt fertig werden können, begibt sich Nelson noch einmal alleine auf die Reise.', 110, 'c2mfe4S12sejFtWTw0lex0q5Cth.jpg', NULL, '1990-08-10', 1551);
